*\n * Bandwidth Monitor\n */\n\nimport { fromIPv4 } from '@utils';\n\nexport default class Data {\n    constructor(id, date, ip, mac, user, down, up, first, last) {\n        this.id = id;\n        this.IP = fromIPv4(ip);\n        this.MAC = mac;\n        this.user = user;\n        this.download = Math.abs(Number(down));\n        this.upload = Math.abs(Number(up));\n        this.firstSeen = Number(first);\n        this.lastSeen = Number(last);\n        this.year = +date.split('-')[0];\n        this.month = +date.split('-')[1];\n        this.total = this.download + this.upload;\n        this.days = Math.floor(Math.abs(this.lastSeen - this.firstSeen) / (60 * 60 * 24) + 1);\n        this.average = +(this.total / this.days).toFixed(3);\n    }\n}\n"}},"schemaVersion":"1.0","thresholds":{"high":80,"low":60,"break":80},"testFiles":{"src/features/byuser/UsageByUser.test.jsx":{"tests":[{"id":"0","name":"UsageByUser renders loading state","location":{"start":{"column":6,"line":72}}},{"id":"1","name":"UsageByUser renders error state","location":{"start":{"column":6,"line":79}}},{"id":"2","name":"UsageByUser renders table header","location":{"start":{"column":6,"line":86}}},{"id":"3","name":"UsageByUser renders table body row 1","location":{"start":{"column":6,"line":104}}},{"id":"4","name":"UsageByUser renders table body row 20","location":{"start":{"column":6,"line":119}}},{"id":"5","name":"UsageByUser does not render table body row 21","location":{"start":{"column":6,"line":134}}},{"id":"6","name":"UsageByUser renders table footer","location":{"start":{"column":6,"line":140}}},{"id":"7","name":"UsageByUser renders pagination","location":{"start":{"column":6,"line":153}}},{"id":"8","name":"UsageByUser handles next page change","location":{"start":{"column":6,"line":161}}},{"id":"9","name":"UsageByUser handles last page change","location":{"start":{"column":6,"line":168}}},{"id":"10","name":"UsageByUser handles rows per page change","location":{"start":{"column":6,"line":175}}} License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, within, fireEvent } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport { usePagination, useSortAsc } from '@hooks';\nimport { Search } from '@components';\nimport { fromIPv4 } from '@utils';\nimport UsageByUser from './UsageByUser';\nimport useUsageByUser from './UseUsageByUser';\n\njest.mock('@components/inputs/Search');\njest.mock('@features/byuser/UseUsageByUser');\njest.mock('@hooks/UsePagination');\njest.mock('@hooks/UseSort');\n\ndescribe('UsageByUser', () => {\n    beforeEach(() => {\n        useUsageByUser.mockReturnValue({\n            years: data.years,\n            year: 2021,\n            setYear: jest.fn(),\n            months: data.months,\n            month: 'February',\n            setMonth: jest.fn(),\n            filter: '',\n            setFilter: jest.fn(),\n            data: data,\n            loading: false,\n        });\n        useSortAsc.mockReturnValue({\n            ascending: true,\n            setAscending: jest.fn(),\n            orderBy: 'IP',\n            setOrderBy: jest.fn(),\n        });\n        usePagination.mockReturnValue({\n            page: 0,\n            setPage: jest.fn(),\n            rowsPerPage: 20,\n            setRowsPerPage: jest.fn(),\n        });\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByUser {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByUser.mockReturnValue({ data: null, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n        expect(screen.queryByTestId('user-header')).not.toBeInTheDocument();\n    });\n\n    it('renders error state', () => {\n        useUsageByUser.mockReturnValue({ data: null, loading: false, error: 'Failed to load data' });\n        renderComponent();\n        expect(screen.getByText('Failed to load data')).toBeInTheDocument();\n        expect(screen.queryByTestId('user-header')).not.toBeInTheDocument();\n    });\n\n    it('renders table header', () => {\n        renderComponent();\n        expect(screen.queryByText('Loading...')).not.toBeInTheDocument();\n        const container = screen.getByTestId('user-header');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('IP')).toBeInTheDocument();\n        expect(getByText('MAC')).toBeInTheDocument();\n        expect(getByText('User')).toBeInTheDocument();\n        expect(getByText('Down')).toBeInTheDocument();\n        expect(getByText('Up')).toBeInTheDocument();\n        expect(getByText('Total')).toBeInTheDocument();\n        expect(getByText('Average')).toBeInTheDocument();\n        expect(getByText('Days')).toBeInTheDocument();\n        expect(getByText('First Seen')).toBeInTheDocument();\n        expect(getByText('Last Seen')).toBeInTheDocument();\n    });\n\n    it('renders table body row 1', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-data-0');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('192.168.0.11')).toBeInTheDocument();\n        expect(getByText('11:00:00:00:00:00')).toBeInTheDocument();\n        expect(getByText('User11')).toBeInTheDocument();\n        expect(getByText('0.100')).toBeInTheDocument();\n        expect(getByText('0.010')).toBeInTheDocument();\n        expect(getByText('0.110')).toBeInTheDocument();\n        expect(getByText('1.0%')).toBeInTheDocument();\n        expect(getByText('0.001')).toBeInTheDocument();\n    });\n\n    it('renders table body row 20', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-data-19');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('192.168.0.32')).toBeInTheDocument();\n        expect(getByText('32:00:00:00:00:00')).toBeInTheDocument();\n        expect(getByText('User32')).toBeInTheDocument();\n        expect(getByText('20.000')).toBeInTheDocument();\n        expect(getByText('2.000')).toBeInTheDocument();\n        expect(getByText('22.000')).toBeInTheDocument();\n        expect(getByText('200.0%')).toBeInTheDocument();\n        expect(getByText('0.200')).toBeInTheDocument();\n    });\n\n    it('does not render table body row 21', () => {\n        renderComponent();\n        const container = screen.queryByTestId('user-data-20');\n        expect(container).not.toBeInTheDocument();\n    });\n\n    it('renders table footer', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-footer');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('Totals')).toBeInTheDocument();\n        expect(getByText('10.000')).toBeInTheDocument();\n        expect(getByText('1.000')).toBeInTheDocument();\n        expect(getByText('11.000')).toBeInTheDocument();\n        expect(getByText('0.100')).toBeInTheDocument();\n        expect(getByText('10')).toBeInTheDocument();\n    });\n\n    it('renders pagination', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-pagination-id');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('120 of 27')).toBeInTheDocument();\n    });\n\n    it('handles next page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('next page');\n        fireEvent.click(container);\n        expect(usePagination().setPage).toHaveBeenCalledWith(1);\n    });\n\n    it('handles last page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('last page');\n        fireEvent.click(container);\n        expect(usePagination().setPage).toHaveBeenCalledWith(1);\n    });\n\n    it('handles rows per page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('rows per page');\n        fireEvent.change(container, { target: { value: '27' } });\n        expect(usePagination().setRowsPerPage).toHaveBeenCalledWith(27);\n    });\n\n    it('handles sort by IP', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('IP'));\n        expect(useSortAsc().setAscending).toHaveBeenCalled();\n        expect(useSortAsc().setOrderBy).toHaveBeenCalledWith('IP');\n    });\n\n    it('handles sort by MAC', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('MAC'));\n        expect(useSortAsc().setAscending).toHaveBeenCalled();\n        expect(useSortAsc().setOrderBy).toHaveBeenCalledWith('MAC');\n    });\n\n    it('handles sort by USER', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('User'));\n        expect(useSortAsc().setAscending).toHaveBeenCalled();\n        expect(useSortAsc().setOrderBy).toHaveBeenCalledWith('user');\n    });\n\n    it('handles sort by Total', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('Total'));\n        expect(useSortAsc().setAscending).toHaveBeenCalled();\n        expect(useSortAsc().setOrderBy).toHaveBeenCalledWith('total');\n    });\n\n    it('renders year selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-year');\n        expect(container).toBeInTheDocument();\n        expect(within(container).getByText(2021)).toBeInTheDocument();\n    });\n\n    it('handles year selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#user-year');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 2020 }));\n        expect(useUsageByUser().setYear).toHaveBeenCalledWith(2020);\n    });\n\n    it('renders month selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-month');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('February')).toBeInTheDocument();\n    });\n\n    it('handles month selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#user-month');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 'January' }));\n        expect(useUsageByUser().setMonth).toHaveBeenCalledWith('January');\n    });\n\n    it('handles user filter change', () => {\n        Search.mockImplementation(({ onChange }) => <"+"input data-testid=\"user-filter\" onChange={onChange} />);\n        renderComponent();\n        fireEvent.change(screen.getByTestId('user-filter'), { target: { value: 'John' } });\n        expect(useUsageByUser().setFilter).toHaveBeenCalledWith('John');\n    });\n\n    it('returns the correct number of rows for the first page', () => {\n        usePagination.mockReturnValue({\n            page: 0,\n            setPage: jest.fn(),\n            rowsPerPage: 2,\n            setRowsPerPage: jest.fn(),\n        });\n        renderComponent();\n        expect(screen.getByTestId('user-data-0')).toHaveTextContent('11:00:00:00:00:00');\n        expect(screen.getByTestId('user-data-1')).toHaveTextContent('12:00:00:00:00:00');\n        expect(screen.queryByTestId('user-data-3')).not.toBeInTheDocument();\n    });\n\n    it('returns the correct rows for the second page', () => {\n        usePagination.mockReturnValue({\n            page: 1,\n            setPage: jest.fn(),\n            rowsPerPage: 2,\n            setRowsPerPage: jest.fn(),\n        });\n        renderComponent();\n        expect(screen.getByTestId('user-data-0')).toHaveTextContent('13:00:00:00:00:00');\n        expect(screen.getByTestId('user-data-1')).toHaveTextContent('14:00:00:00:00:00');\n        expect(screen.queryByTestId('user-data-3')).not.toBeInTheDocument();\n    });\n\n    it('returns no rows if data.usage is empty', () => {\n        useUsageByUser.mockReturnValue({\n            years: data.years,\n            year: 2021,\n            setYear: jest.fn(),\n            months: data.months,\n            month: 'February',\n            setMonth: jest.fn(),\n            filter: '',\n            setFilter: jest.fn(),\n            data: { ...data, usage: [] },\n            loading: false,\n        });\n        renderComponent();\n        expect(screen.queryByTestId('user-data-0')).not.toBeInTheDocument();\n    });\n\n    const data = {\n        usage: [\n            {\n                id: 1,\n                IP: fromIPv4('192.168.0.11'),\n                MAC: '11:00:00:00:00:00',\n                user: 'User11',\n                download: 100000,\n                upload: 10000,\n                total: 110000,\n                percent: 1,\n                average: 1000,\n                days: 1,\n                firstSeen: 1320184802,\n                lastSeen: 1322701201,\n            },\n            {\n                id: 2,\n                IP: fromIPv4('192.168.0.12'),\n                MAC: '12:00:00:00:00:00',\n                user: 'User12',\n                download: 200000,\n                upload: 20000,\n                total: 220000,\n                percent: 2,\n                average: 2000,\n                days: 2,\n                firstSeen: 1320184802,\n                lastSeen: 1322701201,\n            },\n            {\n                id: 3,\n                IP: fromIPv4('192.168.0.13'),\n                MAC: '13:00:00:00:00:00',\n                user: 'User13',\n                download: 300000, PreviousPageAction renders previous page button","location":{"start":{"column":10,"line":242}}},{"id":"43","name":"Pagination Suite PreviousPageAction calls onPageChange when button is clicked","location":{"start":{"column":10,"line":247}}},{"id":"44","name":"Pagination Suite PreviousPageAction disables button when already on the first page","location":{"start":{"column":10,"line":253}}},{"id":"45","name":"Pagination Suite PreviousPageAction renders KeyboardArrowRight icon in RTL theme","location":{"start":{"column":10,"line":258}}},{"id":"46","name":"Pagination Suite PreviousPageAction renders KeyboardArrowLeft icon in LTR theme","location":{"start":{"column":10,"line":263}}},{"id":"47","name":"Pagination Suite NextPageAction renders next page button","location":{"start":{"column":10,"line":286}}},{"id":"48","name":"Pagination Suite NextPageAction calls onPageChange when button is clicked","location":{"start":{"column":10,"line":291}}},{"id":"49","name":"Pagination Suite NextPageAction disables button when already on the last page","location":{"start":{"column":10,"line":297}}},{"id":"50","name":"Pagination Suite NextPageAction renders KeyboardArrowLeft icon in RTL theme","location":{"start":{"column":10,"line":303}}},{"id":"51","name":"Pagination Suite NextPageAction renders KeyboardArrowRight icon in LTR theme","location":{"start":{"column":10,"line":308}}},{"id":"52","name":"Pagination Suite calculate lastPage","location":{"start":{"column":6,"line":314}}},{"id":"53","name":"Pagination Suite isFirstPage should be true","location":{"start":{"column":6,"line":318}}},{"id":"54","name":"Pagination Suite isFirstPage should be false","location":{"start":{"column":6,"line":322}}},{"id":"55","name":"Pagination Suite isLastPage should be true","location":{"start":{"column":6,"line":326}}},{"id":"56","name":"Pagination Suite isLastPage should be false","location":{"start":{"column":6,"line":330}}},{"id":"57","name":"Pagination Suite rowsPerPageOptions should have only one page","location":{"start":{"column":6,"line":334}}},{"id":"58","name":"Pagination Suite rowsPerPageOptions should have more than one page","location":{"start":{"column":6,"line":338}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, fireEvent } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport {\n    Pagination,\n    rowsPerPageOptions,\n    FirstPageAction,\n    LastPageAction,\n    PreviousPageAction,\n    NextPageAction,\n    lastPage,\n    isFirstPage,\n    isLastPage,\n} from './Pagination';\n\nconst mockOnPageChange = jest.fn();\n\ndescribe('Pagination Suite', () => {\n    describe('Pagination', () => {\n        const defaultProps = {\n            count: 100,\n            page: 0,\n            rowsPerPage: 10,\n            onPageChange: mockOnPageChange,\n            minimum: 10,\n        };\n\n        const theme = createTheme();\n\n        const renderComponent = (props = defaultProps) =>\n            render(\n                <"+"ThemeProvider theme={theme}>\n                    <"+"table>\n                        <"+"thead>\n                            <"+"tr>\n                                <"+"Pagination {...props} />\n                            <"+"/tr>\n                        <"+"/thead>\n                    <"+"/table>\n                <"+"/ThemeProvider>\n            );\n\n        it('renders pagination actions with ids', () => {\n            renderComponent();\n            // scan-suspicious-ignore-next-line\n            expect(document.querySelector('#select-rows-per-page-id')).toBeInTheDocument();\n            // scan-suspicious-ignore-next-line\n            expect(document.querySelector('#select-label-rows-per-page-id')).toBeInTheDocument();\n        });\n\n        it('renders pagination actions', () => {\n            renderComponent();\n            expect(screen.getByLabelText('rows per page')).toBeInTheDocument();\n            expect(screen.getByLabelText('first page')).toBeInTheDocument();\n            expect(screen.getByLabelText('previous page')).toBeInTheDocument();\n            expect(screen.getByLabelText('next page')).toBeInTheDocument();\n            expect(screen.getByLabelText('last page')).toBeInTheDocument();\n            expect(screen.getByText('110 of 100')).toBeInTheDocument();\n        });\n\n        it('calls onPageChange when next page button is clicked', () => {\n            renderComponent();\n            const nextPageButton = screen.getByLabelText('next page');\n            fireEvent.click(nextPageButton);\n            expect(mockOnPageChange).toHaveBeenCalledWith(expect.anything(), 1);\n        });\n\n        it('disables first and previous page buttons on the first page', () => {\n            renderComponent();\n            expect(screen.getByLabelText('first page')).toBeDisabled();\n            expect(screen.getByLabelText('previous page')).toBeDisabled();\n        });\n\n        it('disables last and next page buttons on the last page', () => {\n            const lastPageProps = { ...defaultProps, page: 9 };\n            renderComponent(lastPageProps);\n            expect(screen.getByLabelText('last page')).toBeDisabled();\n            expect(screen.getByLabelText('next page')).toBeDisabled();\n        });\n\n        it('renders rows per page selector', () => {\n            renderComponent();\n            expect(screen.getByLabelText('rows per page')).toBeInTheDocument();\n        });\n\n        it('displays correct rows per page options', () => {\n            renderComponent();\n            const rowsPerPageSelector = screen.getByLabelText('rows per page');\n            fireEvent.mouseDown(rowsPerPageSelector);\n            expect(screen.getByText('10')).toBeInTheDocument();\n            expect(screen.getByText('20')).toBeInTheDocument();\n            expect(screen.getByText('40')).toBeInTheDocument();\n            expect(screen.getByText('100')).toBeInTheDocument();\n        });\n\n        it('handles edge case where count is less than rowsPerPage', () => {\n            const edgeCaseProps = { ...defaultProps, count: 5, rowsPerPage: 10 };\n            renderComponent(edgeCaseProps);\n            expect(screen.getByLabelText('first page')).toBeDisabled();\n            expect(screen.getByLabelText('previous page')).toBeDisabled();\n            expect(screen.getByLabelText('next page')).toBeDisabled();\n            expect(screen.getByLabelText('last page')).toBeDisabled();\n        });\n\n        it('correctly adjusts rows per page options based on minimum and count', () => {\n            const adjustedProps = { ...defaultProps, count: 75, minimum: 5 };\n            renderComponent(adjustedProps);\n            const rowsPerPageSelector = screen.getByLabelText('rows per page');\n            fireEvent.mouseDown(rowsPerPageSelector);\n            expect(screen.getByText('5')).toBeInTheDocument();\n            expect(screen.getByText('10')).toBeInTheDocument();\n            expect(screen.getByText('20')).toBeInTheDocument();\n            expect(screen.getByText('40')).toBeInTheDocument();\n            expect(screen.getByText('75')).toBeInTheDocument();\n        });\n    });\n\n    describe('FirstPageAction', () => {\n        const defaultProps = {\n            page: 1,\n            onPageChange: mockOnPageChange,\n        };\n\n        const renderComponent = (props = defaultProps, themeDirection = 'ltr') => {\n            const theme = createTheme({ direction: themeDirection });\n            return render(\n                <"+"ThemeProvider theme={theme}>\n                    <"+"FirstPageAction {...props} />\n                <"+"/ThemeProvider>\n            );\n        };\n\n        it('renders first page button', () => {\n            renderComponent();\n            expect(screen.getByLabelText('first page')).toBeInTheDocument();\n        });\n\n        it('calls onPageChange when button is clicked', () => {\n            renderComponent();\n            fireEvent.click(screen.getByLabelText('first page'));\n\n            expect(mockOnPageChange).toHaveBeenCalledWith(expect.anything(), 0);\n        });\n\n        it('disables button when page is the first page', () => {\n            renderComponent({ page: 0, onPageChange: mockOnPageChange });\n            expect(screen.getByLabelText('first page')).toBeDisabled();\n        });\n\n        it('renders LastPage icon in RTL theme', () => {\n            renderComponent(defaultProps, 'rtl');\n            expect(screen.getByLabelText('first page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n\n        it('renders FirstPage icon in LTR theme', () => {\n            renderComponent(defaultProps, 'ltr');\n            expect(screen.getByLabelText('first page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n    });\n\n    describe('LastPageAction', () => {\n        const defaultProps = {\n            count: 100,\n            page: 1,\n            rowsPerPage: 10,\n            onPageChange: mockOnPageChange,\n        };\n\n        const renderComponent = (props = defaultProps, themeDirection = 'ltr') => {\n            const theme = createTheme({ direction: themeDirection });\n            return render(\n                <"+"ThemeProvider theme={theme}>\n                    <"+"LastPageAction {...props} />\n                <"+"/ThemeProvider>\n            );\n        };\n\n        it('renders last page button', () => {\n            renderComponent();\n            expect(screen.getByLabelText('last page')).toBeInTheDocument();\n        });\n\n        it('calls onPageChange when button is clicked', () => {\n            renderComponent();\n            fireEvent.click(screen.getByLabelText('last page'));\n            const lastPageIndex = Math.max(0, Math.ceil(defaultProps.count / defaultProps.rowsPerPage) - 1);\n            expect(mockOnPageChange).toHaveBeenCalledWith(expect.anything(), lastPageIndex);\n        });\n\n        it('disables button when already on the last page', () => {\n            const props = { ...defaultProps, page: 9 };\n            renderComponent(props);\n            expect(screen.getByLabelText('last page')).toBeDisabled();\n        });\n\n        it('renders FirstPage icon in RTL theme', () => {\n            renderComponent(defaultProps, 'rtl');\n            expect(screen.getByLabelText('last page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n\n        it('renders LastPage icon in LTR theme', () => {\n            renderComponent(defaultProps, 'ltr');\n            expect(screen.getByLabelText('last page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n    });\n\n    describe('PreviousPageAction', () => {\n        const defaultProps = {\n            page: 1,\n            onPageChange: mockOnPageChange,\n        };\n\n        const renderComponent = (props = defaultProps, themeDirection = 'ltr') => {\n            const theme = createTheme({ direction: themeDirection });\n            return render(\n                <"+"ThemeProvider theme={theme}>\n                    <"+"PreviousPageAction {...props} />\n                <"+"/ThemeProvider>\n            );\n        };\n\n        it('renders previous page button', () => {\n            renderComponent();\n            expect(screen.getByLabelText('previous page')).toBeInTheDocument();\n        });\n\n        it('calls onPageChange when button is clicked', () => {\n            renderComponent();\n            fireEvent.click(screen.getByLabelText('previous page'));\n            expect(mockOnPageChange).toHaveBeenCalledWith(expect.anything(), 0);\n        });\n\n        it('disables button when already on the first page', () => {\n            renderComponent({ page: 0, onPageChange: mockOnPageChange });\n            expect(screen.getByLabelText('previous page')).toBeDisabled();\n        });\n\n        it('renders KeyboardArrowRight icon in RTL theme', () => {\n            renderComponent(defaultProps, 'rtl');\n            expect(screen.getByLabelText('previous page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n\n        it('renders KeyboardArrowLeft icon in LTR theme', () => {\n            renderComponent(defaultProps, 'ltr');\n            expect(screen.getByLabelText('previous page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n    });\n\n    describe('NextPageAction', () => {\n        const defaultProps = {\n            count: 100,\n            page: 0,\n            rowsPerPage: 10,\n            onPageChange: mockOnPageChange,\n        };\n\n        const renderComponent = (props = defaultProps, themeDirection = 'ltr') => {\n            const theme = createTheme({ direction: themeDirection });\n            return render(\n                <"+"ThemeProvider theme={theme}>\n                    <"+"NextPageAction {...props} />\n                <"+"/ThemeProvider>\n            );\n        };\n\n        it('renders next page button', () => {\n            renderComponent();\n            expect(screen.getByLabelText('next page')).toBeInTheDocument();\n        });\n\n        it('calls onPageChange when button is clicked', () => {\n            renderComponent();\n            fireEvent.click(screen.getByLabelText('next page'));\n            expect(mockOnPageChange).toHaveBeenCalledWith(expect.anything(), 1);\n        });\n\n        it('disables button when already on the last page', () => {\n            const lastPageProps = { ...defaultProps, page: 9 };\n            renderComponent(lastPageProps);\n            expect(screen.getByLabelText('next page')).toBeDisabled();\n        });\n\n        it('renders KeyboardArrowLeft icon in RTL theme', () => {\n            renderComponent(defaultProps, 'rtl');\n            expect(screen.getByLabelText('next page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n\n        it('renders KeyboardArrowRight icon in LTR theme', () => {\n            renderComponent(defaultProps, 'ltr');\n            expect(screen.getByLabelText('next page').querySelector('svg')).toHaveClass('MuiSvgIcon-root');\n        });\n    });\n\n    it('calculate lastPage', () => {\n        expect(lastPage(100, 10)).toBe(9);\n    });\n\n    it('isFirstPage should be true', () => {\n        expect(isFirstPage(0)).toBeTruthy();\n    });\n\n    it('isFirstPage should be false', () => {\n        expect(isFirstPage(1)).toBeFalsy();\n    });\n\n    it('isLastPage should be true', () => {\n        expect(isLastPage(10, 100, 10)).toBeTruthy();\n    });\n\n    it('isLastPage should be false', () => {\n        expect(isLastPage(1, 100, 10)).toBeFalsy();\n    });\n\n    it('rowsPerPageOptions should have only one page', () => {\n        expect(rowsPerPageOptions(1, 1)).toStrictEqual([1]);\n    });\n\n    it('rowsPerPageOptions should have more than one page', () => {\n        expect(rowsPerPageOptions(1, 4)).toStrictEqual([1, 2, 4]);\n    });\n});\n"},"src/services/API.test.js":{"tests":[{"id":"59","name":"API should return years","location":{"start":{"column":6,"line":26}}},{"id":"60","name":"API should return months","location":{"start":{"column":6,"line":32}}},{"id":"61","name":"API should return data by year","location":{"start":{"column":6,"line":50}}},{"id":"62","name":"API should return usage data by month","location":{"start":{"column":6,"line":60}}},{"id":"63","name":"API should return total by month","location":{"start":{"column":6,"line":90}}},{"id":"64","name":"API should return usage data by user","location":{"start":{"column":6,"line":103}}},{"id":"65","name":"API should return usage data by user with filter using IP","location":{"start":{"column":6,"line":206}}},{"id":"66","name":"API should return usage data by user with filter using MAC","location":{"start":{"column":6,"line":245}}},{"id":"67","name":"API should return usage data by user with filter using user","location":{"start":{"column":6,"line":300}}},{"id":"68","name":"API should return total by user","location":{"start":{"column":6,"line":323}}},{"id":"69","name":"API should not mutate cached data when getUsageByUser is called multiple times","location":{"start":{"column":6,"line":329}}},{"id":"70","name":"API should not mutate cached data when getUsageByMonth is called multiple times","location":{"start":{"column":6,"line":340}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { fromIPv4 } from '@utils';\nimport API from './API';\n\njest.mock('@services/Usage');\n\ndescribe('API', () => {\n    it('should return years', async () => {\n        const expected = [2013, 2012, 2011];\n        const actual = await API.getYears();\n        expect(JSON.stringify(actual)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return months', async () => {\n        const expected = [\n            'November',\n            'October',\n            'September',\n            'August',\n            'July',\n            'June',\n            'May',\n            'April',\n            'March',\n            'February',\n            'January',\n        ];\n        const actual = await API.getMonths(2013);\n        expect(JSON.stringify(actual)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return data by year', async () => {\n        const expected = [\n            { id: 2013, download: 603928097, upload: 35772955, total: 639701052, average: 1752605.622, days: 365 },\n            { id: 2012, download: 413484937, upload: 23242362, total: 436727299, average: 1193243.986, days: 366 },\n            { id: 2011, download: 139938627, upload: 10744984, total: 150683611, average: 412831.811, days: 365 },\n        ];\n        const actual = await API.getUsageByYear();\n        expect(JSON.stringify(actual)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return usage data by month', async () => {\n        const expected = [\n            {\n                id: 12,\n                download: 21926209,\n                upload: 1936607,\n                total: 23862816,\n                average: 769768.258,\n                days: 31,\n                percent: 15.8,\n            },\n            { id: 11, download: 10920971, upload: 693868, total: 11614839, average: 387161.3, days: 30, percent: 7.7 },\n            { id: 10, download: 13960244, upload: 1577944, total: 15538188, average: 501231.871, days: 31, percent: 10.3 },\n            { id: 9, download: 14874630, upload: 1162039, total: 16036669, average: 534555.633, days: 30, percent: 10.6 },\n            {\n                id: 8,\n                download: 29506551,\n                upload: 1782830,\n                total: 31289381,\n                average: 1009334.871,\n                days: 31,\n                percent: 20.8,\n            },\n            { id: 7, download: 21800593, upload: 1506038, total: 23306631, average: 751826.806, days: 31, percent: 15.5 },\n            { id: 6, download: 26949429, upload: 2085658, total: 29035087, average: 967836.233, days: 30, percent: 19.3 },\n        ];\n        const actual = await API.getUsageByMonth(2011);\n        expect(JSON.stringify(actual.usage)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return total by month', async () => {\n        const expected = {\n            id: 2011,\n            download: 139938627,\n            upload: 10744984,\n            total: 150683611,\n            average: 412831.811,\n            days: 365,\n        };\n        const actual = await API.getUsageByMonth(2011);\n        expect(JSON.stringify(actual.total)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return usage data by user', async () => {\n        const expected = [\n            {\n                id: 37,\n                IP: fromIPv4('192.168.1.10'),\n                MAC: '00:1C:25:27:9B:AE',\n                user: 'COMPUTER-3',\n                download: 7241231,\n                upload: 410184,\n                firstSeen: 1320188401,\n                lastSeen: 1322703002,\n                year: 2011,\n                month: 11,\n                total: 7651415,\n                days: 30,\n                average: 255047.167,\n                percent: 65.9,\n            },\n            {\n                id: 36,\n                IP: fromIPv4('192.168.1.12'),\n                MAC: '00:26:9E:C4:A0:40',\n                user: 'COMPUTER-5',\n                download: 2734650,\n                upload: 246716,\n                firstSeen: 1320184802,\n                lastSeen: 1322701201,\n                year: 2011,\n                month: 11,\n                total: 2981366,\n                days: 30,\n                average: 99378.867,\n                percent: 25.7,\n            },\n            {\n                id: 33,\n                IP: fromIPv4('192.168.1.14'),\n                MAC: '00:24:8D:28:F2:9A',\n                user: 'COMPUTER-1',\n                download: 232214,\n                upload: 6366,\n                firstSeen: 1320519602,\n                lastSeen: 1322361007,\n                year: 2011,\n                month: 11,\n                total: 238580,\n                days: 22,\n                average: 10844.545,\n                percent: 2.1,\n            },\n            {\n                id: 35,\n                IP: fromIPv4('192.168.1.15'),\n                MAC: '00:1A:A0:C7:19:08',\n                user: 'COMPUTER-9',\n                download: 655493,\n                upload: 22010,\n                firstSeen: 1321403402,\n                lastSeen: 1322701201,\n                year: 2011,\n                month: 11,\n                total: 677503,\n                days: 16,\n                average: 42343.938,\n                percent: 5.8,\n            },\n            {\n                id: 38,\n                IP: fromIPv4('192.168.1.21'),\n                MAC: '00:23:7A:F7:A0:D0',\n                user: 'COMPUTER-2',\n                download: 654,\n                upload: 210,\n                firstSeen: 1320183002,\n                lastSeen: 1322713801,\n                year: 2011,\n                month: 11,\n                total: 864,\n                days: 30,\n                average: 28.8,\n                percent: 0,\n            },\n            {\n                id: 34,\n                IP: fromIPv4('192.168.1.24'),\n                MAC: '00:27:10:0E:B5:60',\n                user: 'COMPUTER-4',\n                download: 56729,\n                upload: 8382,\n                firstSeen: 1322274602,\n                lastSeen: 1322407802,\n                year: 2011,\n                month: 11,\n                total: 65111,\n                days: 2,\n                average: 32555.5,\n                percent: 0.6,\n            },\n        ];\n        const actual = await API.getUsageByUser(2011, 'November');\n        expect(JSON.stringify(actual.usage)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return usage data by user with filter using IP', async () => {\n        const expected = [\n            {\n                id: 38,\n                IP: fromIPv4('192.168.1.21'),\n                MAC: '00:23:7A:F7:A0:D0',\n                user: 'COMPUTER-2',\n                download: 654,\n                upload: 210,\n                firstSeen: 1320183002,\n                lastSeen: 1322713801,\n                year: 2011,\n                month: 11,\n                total: 864,\n                days: 30,\n                average: 28.8,\n                percent: 1.3,\n            },\n            {\n                id: 34,\n                IP: fromIPv4('192.168.1.24'),\n                MAC: '00:27:10:0E:B5:60',\n                user: 'COMPUTER-4',\n                download: 56729,\n                upload: 8382,\n                firstSeen: 1322274602,\n                lastSeen: 1322407802,\n                year: 2011,\n                month: 11,\n                total: 65111,\n                days: 2,\n                average: 32555.5,\n                percent: 98.7,\n            },\n        ];\n        const actual = await API.getUsageByUser(2011, 'November', '.2');\n        expect(JSON.stringify(actual.usage)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return usage data by user with filter using MAC', async () => {\n        const expected = [\n            {\n                id: 36,\n                IP: fromIPv4('192.168.1.12'),\n                MAC: '00:26:9E:C4:A0:40',\n                user: 'COMPUTER-5',\n                download: 2734650,\n                upload: 246716,\n                firstSeen: 1320184802,\n                lastSeen: 1322701201,\n                year: 2011,\n                month: 11,\n                total: 2981366,\n                days: 30,\n                average: 99378.867,\n                percent: 81.5,\n            },\n            {\n                id: 35,\n                IP: fromIPv4('192.168.1.15'),\n                MAC: '00:1A:A0:C7:19:08',\n                user: 'COMPUTER-9',\n                download: 655493,\n                upload: 22010,\n                firstSeen: 1321403402,\n                lastSeen: 1322701201,\n                year: 2011,\n                month: 11,\n                total: 677503,\n                days: 16,\n                average: 42343.938,\n                percent: 18.5,\n            },\n            {\n                id: 38,\n                IP: fromIPv4('192.168.1.21'),\n                MAC: '00:23:7A:F7:A0:D0',\n                user: 'COMPUTER-2',\n                download: 654,\n                upload: 210,\n                firstSeen: 1320183002,\n                lastSeen: 1322713801,\n                year: 2011,\n                month: 11,\n                total: 864,\n                days: 30,\n                average: 28.8,\n                percent: 0,\n            },\n        ];\n        const actual = await API.getUsageByUser(2011, 'November', ':A0');\n        expect(JSON.stringify(actual.usage)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return usage data by user with filter using user', async () => {\n        const expected = [\n            {\n                id: 38,\n                IP: fromIPv4('192.168.1.21'),\n                MAC: '00:23:7A:F7:A0:D0',\n                user: 'COMPUTER-2',\n                download: 654,\n                upload: 210,\n                firstSeen: 1320183002,\n                lastSeen: 1322713801,\n                year: 2011,\n                month: 11,\n                total: 864,\n                days: 30,\n                average: 28.8,\n                percent: 100,\n            },\n        ];\n        const actual = await API.getUsageByUser(2011, 'November', '-2');\n        expect(JSON.stringify(actual.usage)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should return total by user', async () => {\n        const expected = { id: 11, download: 10920971, upload: 693868, total: 11614839, average: 387161.3, days: 30 };\n        const actual = await API.getUsageByUser(2011, 'November');\n        expect(JSON.stringify(actual.total)).toEqual(JSON.stringify(expected));\n    });\n\n    it('should not mutate cached data when getUsageByUser is called multiple times', async () => {\n        const firstCall = await API.getUsageByUser(2011, 'November');\n        const firstResultPercent = firstCall.usage[0].percent;\n\n        const secondCall = await API.getUsageByUser(2011, 'November');\n\n        expect(firstCall.usage[0].percent).toEqual(firstResultPercent);\n        expect(secondCall.usage[0].percent).toEqual(firstResultPercent);\n        expect(firstCall.usage).not.toBe(secondCall.usage);\n    });\n\n    it('should not mutate cached data when getUsageByMonth is called multiple times', async () => {\n        const firstCall = await API.getUsageByMonth(2011);\n        const firstResultPercent = firstCall.usage[0].percent;\n\n        const secondCall = await API.getUsageByMonth(2011);\n\n        expect(firstCall.usage[0].percent).toEqual(firstResultPercent);\n        expect(secondCall.usage[0].percent).toEqual(firstResultPercent);\n        expect(firstCall.usage).not.toBe(secondCall.usage);\n    });\n});\n"},"src/features/byyear/UsageByYear.test.jsx":{"tests":[{"id":"71","name":"UsageByYear renders loading state","location":{"start":{"column":6,"line":90}}},{"id":"72","name":"UsageByYear renders error state","location":{"start":{"column":6,"line":97}}},{"id":"73","name":"UsageByYear renders table header","location":{"start":{"column":6,"line":104}}},{"id":"74","name":"UsageByYear renders table body row 1","location":{"start":{"column":6,"line":118}}},{"id":"75","name":"UsageByYear renders table body row 20","location":{"start":{"column":6,"line":130}}},{"id":"76","name":"UsageByYear does not render table body row 21","location":{"start":{"column":6,"line":142}}},{"id":"77","name":"UsageByYear renders pagination","location":{"start":{"column":6,"line":148}}},{"id":"78","name":"UsageByYear handles next page change","location":{"start":{"column":6,"line":156}}},{"id":"79","name":"UsageByYear handles last page change","location":{"start":{"column":6,"line":163}}},{"id":"80","name":"UsageByYear handles rows per page change","location":{"start":{"column":6,"line":170}}},{"id":"81","name":"UsageByYear handles sort request by year","location":{"start":{"column":6,"line":177}}},{"id":"82","name":"UsageByYear handles sort request by total","location":{"start":{"column":6,"line":184}}},{"id":"83","name":"UsageByYear renders sorted and paginated data (sortedData)","location":{"start":{"column":6,"line":191}}},{"id":"84","name":"UsageByYear renders sorted and paginated data (sortedData, descending)","location":{"start":{"column":6,"line":211}}},{"id":"85","name":"UsageByYear renders sorted and paginated data (sortedData, sort by total)","location":{"start":{"column":6,"line":231}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, within, fireEvent } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport { usePagination, useSortDesc } from '@hooks';\nimport UsageByYear from './UsageByYear';\nimport useUsageByYear from './UseUsageByYear';\n\njest.mock('@features/byyear/UseUsageByYear');\njest.mock('@hooks/UsePagination');\njest.mock('@hooks/UseSort');\n\ndescribe('UsageByYear', () => {\n    const data = [\n        { id: '2001', download: 100000, upload: 10000, total: 110000, average: 1000, days: 1 },\n        { id: '2002', download: 200000, upload: 20000, total: 220000, average: 2000, days: 2 },\n        { id: '2003', download: 300000, upload: 30000, total: 330000, average: 3000, days: 3 },\n        { id: '2004', download: 400000, upload: 40000, total: 440000, average: 4000, days: 4 },\n        { id: '2005', download: 500000, upload: 50000, total: 550000, average: 5000, days: 5 },\n        { id: '2006', download: 600000, upload: 60000, total: 660000, average: 6000, days: 6 },\n        { id: '2007', download: 700000, upload: 70000, total: 770000, average: 7000, days: 7 },\n        { id: '2008', download: 800000, upload: 80000, total: 880000, average: 8000, days: 8 },\n        { id: '2009', download: 900000, upload: 90000, total: 990000, average: 9000, days: 9 },\n        { id: '2010', download: 1000000, upload: 100000, total: 1100000, average: 10000, days: 10 },\n        { id: '2011', download: 1000000, upload: 100000, total: 1100000, average: 11000, days: 11 },\n        { id: '2012', download: 2000000, upload: 200000, total: 2200000, average: 22000, days: 12 },\n        { id: '2013', download: 3000000, upload: 300000, total: 3300000, average: 33000, days: 13 },\n        { id: '2014', download: 4000000, upload: 400000, total: 4400000, average: 44000, days: 14 },\n        { id: '2015', download: 5000000, upload: 500000, total: 5500000, average: 55000, days: 15 },\n        { id: '2016', download: 6000000, upload: 600000, total: 6600000, average: 66000, days: 16 },\n        { id: '2017', download: 7000000, upload: 700000, total: 7700000, average: 77000, days: 17 },\n        { id: '2018', download: 8000000, upload: 800000, total: 8800000, average: 88000, days: 18 },\n        { id: '2019', download: 9000000, upload: 900000, total: 9900000, average: 99000, days: 19 },\n        { id: '2020', download: 10000000, upload: 1000000, total: 11000000, average: 100000, days: 20 },\n        { id: '2021', download: 10000000, upload: 1000000, total: 11000000, average: 110000, days: 21 },\n        { id: '2022', download: 20000000, upload: 2000000, total: 22000000, average: 220000, days: 22 },\n        { id: '2023', download: 30000000, upload: 3000000, total: 33000000, average: 330000, days: 23 },\n        { id: '2024', download: 40000000, upload: 4000000, total: 44000000, average: 440000, days: 24 },\n        { id: '2025', download: 50000000, upload: 5000000, total: 55000000, average: 550000, days: 25 },\n        { id: '2026', download: 60000000, upload: 6000000, total: 66000000, average: 660000, days: 26 },\n        { id: '2027', download: 70000000, upload: 7000000, total: 77000000, average: 770000, days: 27 },\n        { id: '2028', download: 80000000, upload: 8000000, total: 88000000, average: 880000, days: 28 },\n        { id: '2029', download: 90000000, upload: 9000000, total: 99000000, average: 990000, days: 29 },\n    ];\n\n    beforeEach(() => {\n        useUsageByYear.mockReturnValue({ data: data, loading: false });\n        useSortDesc.mockReturnValue({\n            ascending: true,\n            setAscending: jest.fn(),\n            orderBy: 'id',\n            setOrderBy: jest.fn(),\n        });\n        usePagination.mockReturnValue({\n            page: 0,\n            setPage: jest.fn(),\n            rowsPerPage: 20,\n            setRowsPerPage: jest.fn(),\n        });\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByYear {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByYear.mockReturnValue({ data: null, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n        expect(screen.queryByTestId('year-header')).not.toBeInTheDocument();\n    });\n\n    it('renders error state', () => {\n        useUsageByYear.mockReturnValue({ data: null, loading: false, error: 'Failed to load data' });\n        renderComponent();\n        expect(screen.getByText('Failed to load data')).toBeInTheDocument();\n        expect(screen.queryByTestId('year-header')).not.toBeInTheDocument();\n    });\n\n    it('renders table header', () => {\n        renderComponent();\n        expect(screen.queryByText('Loading...')).not.toBeInTheDocument();\n        const container = screen.getByTestId('year-header');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('Year')).toBeInTheDocument();\n        expect(getByText('Down')).toBeInTheDocument();\n        expect(getByText('Up')).toBeInTheDocument();\n        expect(getByText('Total')).toBeInTheDocument();\n        expect(getByText('Average')).toBeInTheDocument();\n        expect(getByText('Days')).toBeInTheDocument();\n    });\n\n    it('renders table body row 1', () => {\n        renderComponent();\n        const container = screen.getByTestId('year-data-0');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('2001')).toBeInTheDocument();\n        expect(getByText('0.100')).toBeInTheDocument();\n        expect(getByText('0.010')).toBeInTheDocument();\n        expect(getByText('0.110')).toBeInTheDocument();\n        expect(getByText('0.010')).toBeInTheDocument();\n    });\n\n    it('renders table body row 20', () => {\n        renderComponent();\n        const container = screen.getByTestId('year-data-19');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('2020')).toBeInTheDocument();\n        expect(getByText('10.000')).toBeInTheDocument();\n        expect(getByText('1.000')).toBeInTheDocument();\n        expect(getByText('11.000')).toBeInTheDocument();\n        expect(getByText('0.100')).toBeInTheDocument();\n    });\n\n    it('does not render table body row 21', () => {\n        renderComponent();\n        const container = screen.queryByTestId('year-data-20');\n        expect(container).not.toBeInTheDocument();\n    });\n\n    it('renders pagination', () => {\n        renderComponent();\n        const container = screen.getByTestId('year-pagination-id');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('120 of 29')).toBeInTheDocument();\n    });\n\n    it('handles next page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('next page');\n        fireEvent.click(container);\n        expect(usePagination().setPage).toHaveBeenCalledWith(1);\n    });\n\n    it('handles last page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('last page');\n        fireEvent.click(container);\n        expect(usePagination().setPage).toHaveBeenCalledWith(1);\n    });\n\n    it('handles rows per page change', () => {\n        renderComponent();\n        const container = screen.getByLabelText('rows per page');\n        fireEvent.change(container, { target: { value: '29' } });\n        expect(usePagination().setRowsPerPage).toHaveBeenCalledWith(29);\n    });
