  '192.168.1.25',\n                    '192.168.1.26',\n                    '192.168.1.27',\n                ],\n            },\n        };\n        const expectedSeries = [\n            {\n                name: 'Total Usage',\n                data: ['10.7', '1.1', '9.6', '0.2', '0.2', '12.4', '1.2', '0.3', '0.9'],\n            },\n        ];\n        const { result } = renderHook(useUsageByUserGraph);\n        await waitFor(() => {\n            act(() => result.current.setMonth(expected));\n            expect(result.current.options).toEqual(expectedOptions);\n            expect(result.current.series).toEqual(expectedSeries);\n        });\n    });\n\n    it('changing filter should change filter', async () => {\n        const expected = '20';\n        const { result } = renderHook(useUsageByUserGraph);\n        await waitFor(() => {\n            act(() => result.current.setFilter(expected));\n            expect(result.current.filter).toEqual(expected);\n        });\n    });\n\n    it('changing filter should change usage', async () => {\n        const expected = '20';\n        const expectedOptions = {\n            chart: {\n                id: 'usage-by-user',\n                toolbar: {\n                    show: false,\n                },\n            },\n            xaxis: {\n                categories: ['192.168.1.20', '192.168.1.113', '192.168.1.120'],\n            },\n        };\n        const expectedSeries = [\n            {\n                name: 'Total Usage',\n                data: ['0.0', '0.0', '0.1'],\n            },\n        ];\n        const { result } = renderHook(useUsageByUserGraph);\n        await waitFor(() => {\n            act(() => result.current.setFilter(expected));\n            expect(result.current.options).toEqual(expectedOptions);\n            expect(result.current.series).toEqual(expectedSeries);\n        });\n    });\n});\n"},"src/utils/SortUtils.test.js":{"tests":[{"id":"107","name":"SortUtils comparator ascending 1","location":{"start":{"column":10,"line":32}}},{"id":"108","name":"SortUtils comparator ascending -1","location":{"start":{"column":10,"line":39}}},{"id":"109","name":"SortUtils comparator ascending 0","location":{"start":{"column":10,"line":46}}},{"id":"110","name":"SortUtils comparator descending 1","location":{"start":{"column":10,"line":53}}},{"id":"111","name":"SortUtils comparator descending -1","location":{"start":{"column":10,"line":60}}},{"id":"112","name":"SortUtils comparator descending 0","location":{"start":{"column":10,"line":67}}},{"id":"113","name":"SortUtils comparator should sort ascending by age","location":{"start":{"column":10,"line":74}}},{"id":"114","name":"SortUtils comparator should sort descending by age","location":{"start":{"column":10,"line":80}}},{"id":"115","name":"SortUtils comparator should return 0 for unsafe key","location":{"start":{"column":10,"line":86}}},{"id":"116","name":"SortUtils comparator should handle non-string keys safely","location":{"start":{"column":10,"line":91}}},{"id":"117","name":"SortUtils comparator should handle keys with special characters as unsafe","location":{"start":{"column":10,"line":96}}},{"id":"118","name":"SortUtils comparator should return 0 if orderBy key is missing in a","location":{"start":{"column":10,"line":100}}},{"id":"119","name":"SortUtils comparator should return 0 if orderBy key is missing in b","location":{"start":{"column":10,"line":107}}},{"id":"120","name":"SortUtils comparator should return 0 for empty string key","location":{"start":{"column":10,"line":114}}},{"id":"121","name":"SortUtils comparator should return 0 for key with special characters","location":{"start":{"column":10,"line":121}}},{"id":"122","name":"SortUtils comparator should return 0 for symbol key","location":{"start":{"column":10,"line":128}}},{"id":"123","name":"SortUtils comparator should return 0 if both objects missing key","location":{"start":{"column":10,"line":135}}},{"id":"124","name":"SortUtils comparator should handle null values for orderBy","location":{"start":{"column":10,"line":142}}},{"id":"125","name":"SortUtils comparator should handle both values null for orderBy","location":{"start":{"column":10,"line":149}}},{"id":"126","name":"SortUtils comparator should handle non-object arguments","location":{"start":{"column":10,"line":156}}},{"id":"127","name":"SortUtils comparator should preserve order if comparator always returns 0","location":{"start":{"column":10,"line":162}}},{"id":"128","name":"SortUtils sort ascending","location":{"start":{"column":10,"line":171}}},{"id":"129","name":"SortUtils sort descending","location":{"start":{"column":10,"line":182}}},{"id":"130","name":"SortUtils sort should sort using comparator","location":{"start":{"column":10,"line":193}}},{"id":"131","name":"SortUtils sort should not mutate original array","location":{"start":{"column":10,"line":200}}},{"id":"132","name":"SortUtils sort should handle empty array","location":{"start":{"column":10,"line":208}}},{"id":"133","name":"SortUtils isAscending should return true if orderBy matches property and ascending is false","location":{"start":{"column":10,"line":215}}},{"id":"134","name":"SortUtils isAscending should return false if orderBy does not match property","location":{"start":{"column":10,"line":219}}},{"id":"135","name":"SortUtils isAscending should return false if orderBy does not match property and ascending is false","location":{"start":{"column":10,"line":223}}},{"id":"136","name":"SortUtils isAscending should return false if orderBy matches property and ascending is true","location":{"start":{"column":10,"line":227}}},{"id":"137","name":"SortUtils isAscending should test isAscending for all input combinations","location":{"start":{"column":10,"line":231}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { comparator, isAscending, sort } from './SortUtils';\n\ndescribe('SortUtils', () => {\n    describe('comparator', () => {\n        const data = [\n            { name: 'Alice', age: 30 },\n            { name: 'Bob', age: 25 },\n            { name: 'Charlie', age: 35 },\n            { name: 'Eve', age: undefined },\n            { name: 'Mallory' },\n        ];\n\n        it('ascending 1', () => {\n            const a = { value: 20 };\n            const b = { value: 10 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toEqual(1);\n        });\n\n        it('ascending -1', () => {\n            const a = { value: 10 };\n            const b = { value: 20 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toEqual(-1);\n        });\n\n        it('ascending 0', () => {\n            const a = { value: 10 };\n            const b = { value: 10 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toEqual(0);\n        });\n\n        it('descending 1', () => {\n            const a = { value: 10 };\n            const b = { value: 20 };\n            const fn = comparator(false, 'value');\n            expect(fn(a, b)).toEqual(1);\n        });\n\n        it('descending -1', () => {\n            const a = { value: 20 };\n            const b = { value: 10 };\n            const fn = comparator(false, 'value');\n            expect(fn(a, b)).toEqual(-1);\n        });\n\n        it('descending 0', () => {\n            const a = { value: 10 };\n            const b = { value: 10 };\n            const fn = comparator(false, 'value');\n            expect(fn(a, b)).toEqual(0);\n        });\n\n        it('should sort ascending by age', () => {\n            const cmp = comparator(true, 'age');\n            const sorted = [...data].sort(cmp);\n            expect(sorted.map((x) => x.name)).toEqual(['Bob', 'Alice', 'Charlie', 'Eve', 'Mallory']);\n        });\n\n        it('should sort descending by age', () => {\n            const cmp = comparator(false, 'age');\n            const sorted = [...data].sort(cmp);\n            expect(sorted.map((x) => x.name)).toEqual(['Charlie', 'Alice', 'Bob', 'Eve', 'Mallory']);\n        });\n\n        it('should return 0 for unsafe key', () => {\n            const cmp = comparator(true, 'invalid');\n            expect(cmp(data[0], data[1])).toBe(0);\n        });\n\n        it('should handle non-string keys safely', () => {\n            const cmp = comparator(true, 123);\n            expect(cmp(data[0], data[1])).toBe(0);\n        });\n\n        it('should handle keys with special characters as unsafe', () => {\n            const cmp = comparator(true, 'na-me');\n            expect(cmp(data[0], data[1])).toBe(0);\n        });\n        it('should return 0 if orderBy key is missing in a', () => {\n            const a = { foo: 1 };\n            const b = { value: 2 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toEqual(0);\n        });\n\n        it('should return 0 if orderBy key is missing in b', () => {\n            const a = { value: 1 };\n            const b = { foo: 2 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toEqual(0);\n        });\n\n        it('should return 0 for empty string key', () => {\n            const a = { value: 1 };\n            const b = { value: 2 };\n            const fn = comparator(true, '');\n            expect(fn(a, b)).toBe(0);\n        });\n\n        it('should return 0 for key with special characters', () => {\n            const a = { value: 1 };\n            const b = { value: 2 };\n            const fn = comparator(true, '$invalid!');\n            expect(fn(a, b)).toBe(0);\n        });\n\n        it('should return 0 for symbol key', () => {\n            const a = { value: 1 };\n            const b = { value: 2 };\n            const fn = comparator(true, Symbol('value'));\n            expect(fn(a, b)).toBe(0);\n        });\n\n        it('should return 0 if both objects missing key', () => {\n            const a = { foo: 1 };\n            const b = { bar: 2 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toBe(0);\n        });\n\n        it('should handle null values for orderBy', () => {\n            const a = { value: null };\n            const b = { value: 2 };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toBe(-1);\n        });\n\n        it('should handle both values null for orderBy', () => {\n            const a = { value: null };\n            const b = { value: null };\n            const fn = comparator(true, 'value');\n            expect(fn(a, b)).toBe(0);\n        });\n\n        it('should handle non-object arguments', () => {\n            const fn = comparator(true, 'value');\n            expect(fn(42, { value: 1 })).toBe(0);\n            expect(fn({ value: 1 }, 42)).toBe(0);\n        });\n\n        it('should preserve order if comparator always returns 0', () => {\n            const arr = [{ value: 3 }, { value: 1 }, { value: 2 }];\n            const cmp = () => 0;\n            const sorted = sort(arr, cmp);\n            expect(sorted).toEqual(arr);\n        });\n    });\n\n    describe('sort', () => {\n        it('ascending', () => {\n            const values = [{ value: 20 }, { value: 10 }, { value: 30 }, { value: 20 }];\n            const fn = comparator(true, 'value');\n            const expected = [{ value: 10 }, { value: 20 }, { value: 20 }, { value: 30 }];\n\n            const result = sort(values, fn);\n\n            expect(result).toEqual(expected);\n            expect(values !== result).toBeTruthy();\n        });\n\n        it('descending', () => {\n            const values = [{ value: 20 }, { value: 10 }, { value: 30 }];\n            const fn = comparator(false, 'value');\n            const expected = [{ value: 30 }, { value: 20 }, { value: 10 }];\n\n            const result = sort(values, fn);\n\n            expect(result).toEqual(expected);\n            expect(values !== result).toBeTruthy();\n        });\n\n        it('should sort using comparator', () => {\n            const arr = [{ value: 3 }, { value: 1 }, { value: 2 }];\n            const cmp = comparator(true, 'value');\n            const sorted = sort(arr, cmp);\n            expect(sorted.map((x) => x.value)).toEqual([1, 2, 3]);\n        });\n\n        it('should not mutate original array', () => {\n            const arr = [{ value: 2 }, { value: 1 }];\n            const cmp = comparator(true, 'value');\n            const sorted = sort(arr, cmp);\n            expect(arr).toEqual([{ value: 2 }, { value: 1 }]);\n            expect(sorted).not.toBe(arr);\n        });\n\n        it('should handle empty array', () => {\n            const cmp = comparator(true, 'value');\n            expect(sort([], cmp)).toEqual([]);\n        });\n    });\n\n    describe('isAscending', () => {\n        it('should return true if orderBy matches property and ascending is false', () => {\n            expect(isAscending('name', 'name', false)).toBeTruthy();\n        });\n\n        it('should return false if orderBy does not match property', () => {\n            expect(isAscending('name', 'age', true)).toBeFalsy();\n        });\n\n        it('should return false if orderBy does not match property and ascending is false', () => {\n            expect(isAscending('name', 'age', false)).toBeFalsy();\n        });\n\n        it('should return false if orderBy matches property and ascending is true', () => {\n            expect(isAscending('name', 'name', true)).toBeFalsy();\n        });\n\n        it('should test isAscending for all input combinations', () => {\n            expect(isAscending('foo', 'foo', true)).toBeFalsy();\n            expect(isAscending('foo', 'foo', false)).toBeTruthy();\n            expect(isAscending('foo', 'bar', true)).toBeFalsy();\n            expect(isAscending('foo', 'bar', false)).toBeFalsy();\n        });\n    });\n});\n"},"src/components/table/Header.test.jsx":{"tests":[{"id":"138","name":"Header Suite Header renders sortable and non-sortable cells","location":{"start":{"column":10,"line":51}}},{"id":"139","name":"Header Suite Header calls onRequestSort when sortable cell is clicked","location":{"start":{"column":10,"line":61}}},{"id":"140","name":"Header Suite Header renders sorting cell with ids","location":{"start":{"column":10,"line":68}}},{"id":"141","name":"Header Suite Cell renders cell","location":{"start":{"column":10,"line":89}}},{"id":"142","name":"Header Suite SortableCell renders ascending sorting cell","location":{"start":{"column":10,"line":134}}},{"id":"143","name":"Header Suite SortableCell renders descending sorting cell","location":{"start":{"column":10,"line":144}}},{"id":"144","name":"Header Suite SortableCell renders sorting cell with ids","location":{"start":{"column":10,"line":154}}},{"id":"145","name":"Header Suite getDirection","location":{"start":{"column":6,"line":160}}},{"id":"146","name":"Header Suite isActive","location":{"start":{"column":6,"line":165}}},{"id":"147","name":"Header Suite sortDirection","location":{"start":{"column":6,"line":170}}},{"id":"148","name":"Header Suite sortDefaultDirection","location":{"start":{"column":6,"line":176}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, fireEvent } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { Header, Cell, SortableCell, getDirection, sortDirection, sortDefaultDirection, isActive } from './Header';\n\ndescribe('Header Suite', () => {\n    const onRequestSort = jest.fn();\n\n    describe('Header', () => {\n        const cellInfos = [\n            { id: 'name', label: 'Name', align: 'left', sortable: true },\n            { id: 'age', label: 'Age', align: 'right', sortable: true },\n            { id: 'location', label: 'Location', align: 'left', sortable: false },\n        ];\n\n        const defaultProps = {\n            prefix: 'test',\n            cellInfos,\n            onRequestSort: onRequestSort,\n            ascending: true,\n            orderBy: 'name',\n        };\n\n        const renderComponent = (props = defaultProps) => {\n            return render(\n                <"+"table>\n                    <"+"Header {...props} />\n                <"+"/table>\n            );\n        };\n\n        it('renders sortable and non-sortable cells', () => {\n            renderComponent();\n            const headerRow = screen.getByTestId('test-header');\n            expect(headerRow).toBeInTheDocument();\n            const headerCells = screen.getAllByRole('columnheader');\n            expect(headerCells[0]).toHaveTextContent('Name');\n            expect(headerCells[1]).toHaveTextContent('Age');\n            expect(headerCells[2]).toHaveTextContent('Location');\n        });\n\n        it('calls onRequestSort when sortable cell is clicked', () => {\n            renderComponent();\n            const nameSortLabel = screen.getByTestId('test-name').querySelector('.MuiTableSortLabel-root');\n            fireEvent.click(nameSortLabel);\n            expect(onRequestSort).toHaveBeenCalledWith(expect.anything(), 'name');\n        });\n\n        it('renders sorting cell with ids', () => {\n            renderComponent();\n            expect(screen.getByTestId('test-header')).toBeInTheDocument();\n        });\n    });\n\n    describe('Cell', () => {\n        const cellInfo = { id: 'name', label: 'Name', align: 'left' };\n\n        const renderComponent = () => {\n            return render(\n                <"+"table>\n                    <"+"tbody>\n                        <"+"tr>\n                            <"+"Cell key={cellInfo.id} cellInfo={cellInfo} />\n                        <"+"/tr>\n                    <"+"/tbody>\n                <"+"/table>\n            );\n        };\n\n        it('renders cell', () => {\n            renderComponent();\n            expect(screen.getByText('Name')).toBeInTheDocument();\n            expect(screen.getByRole('cell')).toHaveClass('MuiTableCell-alignLeft');\n        });\n    });\n\n    describe('SortableCell', () => {\n        const cellInfo = { id: 'name', label: 'Name', align: 'left', sortable: true };\n\n        const ascendingProps = {\n            prefix: 'test',\n            cellInfo,\n            onRequestSort: onRequestSort,\n            ascending: true,\n            orderBy: 'name',\n        };\n\n        const descendingProps = {\n            prefix: 'test',\n            cellInfo,\n            onRequestSort: onRequestSort,\n            ascending: false,\n            orderBy: 'name',\n        };\n\n        const renderComponent = (props) => {\n            return render(\n                <"+"table>\n                    <"+"tbody>\n                        <"+"tr>\n                            <"+"SortableCell\n                                key={props.cellInfo.id}\n                                prefix={props.prefix}\n                                cellInfo={cellInfo}\n                                sortHandler={props.onRequestSort}\n                                ascending={props.ascending}\n                                orderBy={props.orderBy}\n                            />\n                        <"+"/tr>\n                    <"+"/tbody>\n                <"+"/table>\n            );\n        };\n\n        it('renders ascending sorting cell', () => {\n            renderComponent(ascendingProps);\n            expect(screen.getByTestId('test-name')).toBeInTheDocument();\n            expect(screen.getByText('Name')).toBeInTheDocument();\n            expect(screen.getByRole('cell')).toHaveClass('MuiTableCell-alignLeft');\n            expect(screen.getByRole('button')).toHaveClass('MuiTableSortLabel-directionAsc');\n            expect(screen.getByRole('button')).toHaveClass('Mui-active');\n            expect(screen.getByRole('button')).not.toHaveClass('MuiTableSortLabel-directionDesc');\n        });\n\n        it('renders descending sorting cell', () => {\n            renderComponent(descendingProps);\n            expect(screen.getByTestId('test-name')).toBeInTheDocument();\n            expect(screen.getByText('Name')).toBeInTheDocument();\n            expect(screen.getByRole('cell')).toHaveClass('MuiTableCell-alignLeft');\n            expect(screen.getByRole('button')).toHaveClass('MuiTableSortLabel-directionDesc');\n            expect(screen.getByRole('button')).toHaveClass('Mui-active');\n            expect(screen.getByRole('button')).not.toHaveClass('MuiTableSortLabel-directionAsc');\n        });\n\n        it('renders sorting cell with ids', () => {\n            renderComponent(ascendingProps);\n            expect(screen.getByTestId('test-name')).toBeInTheDocument();\n        });\n    });\n\n    it('getDirection', () => {\n        expect(getDirection(true)).toBe('asc');\n        expect(getDirection(false)).toBe('desc');\n    });\n\n    it('isActive', () => {\n        expect(isActive('id1', 'id1')).toBeTruthy();\n        expect(isActive('id1', 'id2')).toBeFalsy();\n    });\n\n    it('sortDirection', () => {\n        expect(sortDirection('id1', 'id1', true)).toBe('asc');\n        expect(sortDirection('id1', 'id1', false)).toBe('desc');\n        expect(sortDirection('id1', 'id2', true)).toBeFalsy();\n    });\n\n    it('sortDefaultDirection', () => {\n        expect(sortDefaultDirection('id1', 'id1', true)).toBe('asc');\n        expect(sortDefaultDirection('id1', 'id1', false)).toBe('desc');\n        expect(sortDefaultDirection('id1', 'id2', true)).toBe('asc');\n        expect(sortDefaultDirection('id1', 'id2', false)).toBe('asc');\n    });\n});\n"},"src/features/bymonth/UsageByMonth.test.jsx":{"tests":[{"id":"149","name":"UsageByMonth renders loading state","location":{"start":{"column":6,"line":65}}},{"id":"150","name":"UsageByMonth renders error state","location":{"start":{"column":6,"line":72}}},{"id":"151","name":"UsageByMonth renders table header","location":{"start":{"column":6,"line":79}}},{"id":"152","name":"UsageByMonth renders table body row 1","location":{"start":{"column":6,"line":93}}},{"id":"153","name":"UsageByMonth renders table body row 2","location":{"start":{"column":6,"line":106}}},{"id":"154","name":"UsageByMonth renders table footer","location":{"start":{"column":6,"line":119}}},{"id":"155","name":"UsageByMonth renders year selector","location":{"start":{"column":6,"line":132}}},{"id":"156","name":"UsageByMonth handles year selector","location":{"start":{"column":6,"line":139}}},{"id":"157","name":"UsageByMonth handles sort request by month","location":{"start":{"column":6,"line":148}}},{"id":"158","name":"UsageByMonth handles sort request by total","location":{"start":{"column":6,"line":155}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { fireEvent, render, screen, within } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport { useSortDesc } from '@hooks';\nimport UsageByMonth from './UsageByMonth';\nimport useUsageByMonth from './UseUsageByMonth';\n\njest.mock('@features/bymonth/UseUsageByMonth');\njest.mock('@hooks/UseSort');\n\ndescribe('UsageByMonth', () => {\n    const data = {\n        years: [2020, 2021, 2022],\n        year: 2021,\n        setYear: jest.fn(),\n        data: {\n            usage: [\n                { id: 1, download: 100000, upload: 20000, total: 120000, percent: 10, average: 10000, days: 10 },\n                { id: 2, download: 200000, upload: 40000, total: 240000, percent: 20, average: 20000, days: 20 },\n            ],\n            total: { download: 300000, upload: 60000, total: 360000, percent: 30, average: 15000, days: 30 },\n        },\n        loading: false,\n    };\n\n    beforeEach(() => {\n        useUsageByMonth.mockReturnValue(data);\n        useSortDesc.mockReturnValue({\n            ascending: true,\n            setAscending: jest.fn(),\n            orderBy: 'id',\n            setOrderBy: jest.fn(),\n        });\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByMonth {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByMonth.mockReturnValue({ data: null, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n        expect(screen.queryByTestId('month-header')).not.toBeInTheDocument();\n    });\n\n    it('renders error state', () => {\n        useUsageByMonth.mockReturnValue({ data: null, loading: false, error: 'Failed to load data' });\n        renderComponent();\n        expect(screen.getByText('Failed to load data')).toBeInTheDocument();\n        expect(screen.queryByTestId('month-header')).not.toBeInTheDocument();\n    });\n\n    it('renders table header', () => {\n        renderComponent();\n        expect(screen.queryByText('Loading...')).not.toBeInTheDocument();\n        const container = screen.getByTestId('month-header');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('Month')).toBeInTheDocument();\n        expect(getByText('Down')).toBeInTheDocument();\n        expect(getByText('Up')).toBeInTheDocument();\n        expect(getByText('Total')).toBeInTheDocument();\n        expect(getByText('Average')).toBeInTheDocument();\n        expect(getByText('Days')).toBeInTheDocument();\n    });\n\n    it('renders table body row 1', () => {\n        renderComponent();\n        const container = screen.getByTestId('month-data-0');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('January')).toBeInTheDocument();\n        expect(getByText('0.100')).toBeInTheDocument();\n        expect(getByText('0.020')).toBeInTheDocument();\n        expect(getByText('0.120')).toBeInTheDocument();\n        expect(getByText('0.010')).toBeInTheDocument();\n        expect(getByText('10')).toBeInTheDocument();\n    });\n\n    it('renders table body row 2', () => {\n        renderComponent();\n        const container = screen.getByTestId('month-data-1');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('February')).toBeInTheDocument();\n        expect(getByText('0.200')).toBeInTheDocument();\n        expect(getByText('0.040')).toBeInTheDocument();\n        expect(getByText('0.240')).toBeInTheDocument();\n        expect(getByText('0.020')).toBeInTheDocument();\n        expect(getByText('20')).toBeInTheDocument();\n    });\n\n    it('renders table footer', () => {\n        renderComponent();\n        const container = screen.getByTestId('month-footer');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('Totals')).toBeInTheDocument();\n        expect(getByText('0.300')).toBeInTheDocument();\n        expect(getByText('0.060')).toBeInTheDocument();\n        expect(getByText('0.360')).toBeInTheDocument();\n        expect(getByText('0.015')).toBeInTheDocument();\n        expect(getByText('30')).toBeInTheDocument();\n    });\n\n    it('renders year selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('month-year');\n        expect(container).toBeInTheDocument();\n        expect(within(container).getByText(2021)).toBeInTheDocument();\n    });\n\n    it('handles year selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#month-year');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 2020 }));\n        expect(useUsageByMonth().setYear).toHaveBeenCalledWith(2020);\n    });\n\n    it('handles sort request by month', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('Month'));\n        expect(useSortDesc().setAscending).toHaveBeenCalled();\n        expect(useSortDesc().setOrderBy).toHaveBeenCalledWith('id');\n    });\n\n    it('handles sort request by total', () => {\n        renderComponent();\n        fireEvent.click(screen.getByText('Total'));\n        expect(useSortDesc().setAscending).toHaveBeenCalled();\n        expect(useSortDesc().setOrderBy).toHaveBeenCalledWith('total');\n    });\n});\n"},"src/features/bymonth/UseUsageByMonth.test.js":{"tests":[{"id":"159","name":"UseUsageByMonth should initialize years","location":{"start":{"column":6,"line":34}}},{"id":"160","name":"UseUsageByMonth should initialize usage","location":{"start":{"column":6,"line":43}}},{"id":"161","name":"UseUsageByMonth changing year should change year","location":{"start":{"column":6,"line":81}}},{"id":"162","name":"UseUsageByMonth changing year should change usage","location":{"start":{"column":6,"line":90}}},{"id":"163","name":"UseUsageByMonth should set error when API.getUsageByMonth fails","location":{"start":{"column":6,"line":122}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport useUsageByMonth from './UseUsageByMonth';\nimport { API } from '@services';\n\njest.mock('@services/Usage');\n\ndescribe('UseUsageByMonth', () => {\n    const expectedYears = [2013, 2012, 2011];\n    const expectedYearsCount = 3;\n\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    it('should initialize years', async () => {\n        const { result } = renderHook(useUsageByMonth);\n        await waitFor(() => {\n            expect(result.current.years.length).toEqual(expectedYearsCount);\n            expect(result.current.years).toEqual(expectedYears);\n            expect(result.current.year).toEqual(expectedYears[0]);\n        });\n    });\n\n    it('should initialize usage', async () => {\n        const expectedCount = 11;\n        const expectedTotal = {\n            average: 1752605.622,\n            days: 365,\n            download: 603928097,\n            id: 2013,\n            total: 639701052,\n            upload: 35772955,\n        };\n        const expectedFirst = {\n            average: 2910960.6,\n            days: 30,\n            download: 83065864,\n            id: 11,\n            percent: 13.7,\n            total: 87328818,\n            upload: 4262954,\n        };\n        const expectedLast = {\n            average: 2198342.935,\n            days: 31,\n            download: 64043397,\n            id: 1,\n            percent: 10.7,\n            total: 68148631,\n            upload: 4105234,\n        };\n        const { result } = renderHook(useUsageByMonth);\n        await waitFor(() => {\n            expect(result.current.data.total).toEqual(expectedTotal);\n            expect(result.current.data.usage.length).toEqual(expectedCount);\n            expect(result.current.data.usage[0]).toEqual(expectedFirst);\n            expect(result.current.data.usage[expectedCount - 1]).toEqual(expectedLast);\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n\n    it('changing year should change year', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const { result } = renderHook(useUsageByMonth);\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.year).toEqual(expectedYear);\n        });\n    });\n\n    it('changing year should change usage', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const expectedCount = 7;\n        const expectedTotal = { average: 412831.811, days: 365, download: 139938627, id: 2011, total: 150683611, upload: 10744984 };\n        const expectedFirst = {\n            average: 769768.258,\n            days: 31,\n            download: 21926209,\n            id: 12,\n            percent: 15.8,\n            total: 23862816,\n            upload: 1936607,\n        };\n        const expectedLast = {\n            average: 967836.233,\n            days: 30,\n            download: 26949429,\n            id: 6,\n            percent: 19.3,\n            total: 29035087,\n            upload: 2085658,\n        };\n        const { result } = renderHook(useUsageByMonth);\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.data.total).toEqual(expectedTotal);\n            expect(result.current.data.usage.length).toEqual(expectedCount);\n            expect(result.current.data.usage[0]).toEqual(expectedFirst);\n            expect(result.current.data.usage[expectedCount - 1]).toEqual(expectedLast);\n        });\n    });\n\n    it('should set error when API.getUsageByMonth fails', async () => {\n        const errorMessage = 'API Error';\n        jest.spyOn(API, 'getUsageByMonth').mockRejectedValueOnce(new Error(errorMessage));\n        const { result } = renderHook(useUsageByMonth);\n        await waitFor(() => {\n            expect(result.current.error).toEqual(errorMessage);\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n});\n"},"src/features/byuser/UsageByUserGraph.test.jsx":{"tests":[{"id":"164","name":"UsageByUserGraph renders loading state","location":{"start":{"column":6,"line":59}}},{"id":"165","name":"UsageByUserGraph renders graph when data is loaded","location":{"start":{"column":6,"line":65}}},{"id":"166","name":"UsageByUserGraph renders year selector","location":{"start":{"column":6,"line":70}}},{"id":"167","name":"UsageByUserGraph handles year selector","location":{"start":{"column":6,"line":78}}},{"id":"168","name":"UsageByUserGraph renders month selector","location":{"start":{"column":6,"line":87}}},{"id":"169","name":"UsageByUserGraph handles month selector","location":{"start":{"column":6,"line":95}}},{"id":"170","name":"UsageByUserGraph displays correct graph options and series","location":{"start":{"column":6,"line":104}}},{"id":"171","name":"UsageByUserGraph handles user filter change","location":{"start":{"column":6,"line":117}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, within, fireEvent } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport { Search } from '@components';\nimport UsageByUserGraph from './UsageByUserGraph';\nimport useUsageByUserGraph from './UseUsageByUserGraph';\n\njest.mock('@components/graph/Graph');\njest.mock('@components/inputs/Search');\njest.mock('@features/byuser/UseUsageByUserGraph');\n\ndescribe('UsageByUserGraph', () => {\n    const data = {\n        options: {},\n        series: [],\n        years: [2020, 2021, 2022],\n        year: 2021,\n        setYear: jest.fn(),\n        months: ['January', 'February', 'March'],\n        month: 'February',\n        setMonth: jest.fn(),\n        setFilter: jest.fn(),\n        loading: false,\n    };\n\n    beforeEach(() => {\n        useUsageByUserGraph.mockReturnValue(data);\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByUserGraph {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByUserGraph.mockReturnValue({ ...data, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n    });\n\n    it('renders graph when data is loaded', () => {\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n    });\n\n    it('renders year selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-year-graph');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText(2021)).toBeInTheDocument();\n    });\n\n    it('handles year selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#user-year-graph');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 2020 }));\n        expect(useUsageByUserGraph().setYear).toHaveBeenCalledWith(2020);\n    });\n\n    it('renders month selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('user-month-graph');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText('February')).toBeInTheDocument();\n    });\n\n    it('handles month selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#user-month-graph');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 'January' }));\n        expect(useUsageByUserGraph().setMonth).toHaveBeenCalledWith('January');\n    });\n\n    it('displays correct graph options and series', () => {\n        useUsageByUserGraph.mockReturnValue({\n            options: { chart: { id: 'test-chart' } },\n            series: [{ name: 'test-series', data: [1, 2, 3] }],\n            loading: false,\n        });\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('Graph');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('{\"chart\":{\"id\":\"test-chart\"}}');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('[{\"name\":\"test-series\",\"data\":[1,2,3]}]');\n    });\n\n    it('handles user filter change', () => {\n        Search.mockImplementation(({ onChange }) => <"+"input data-testid=\"user-filter-graph\" onChange={onChange} />);\n        renderComponent();\n        fireEvent.change(screen.getByTestId('user-filter-graph'), { target: { value: 'John' } });\n        expect(data.setFilter).toHaveBeenCalledWith('John');\n    });\n});\n"},"src/hooks/UseYearMonth.test.js":{"tests":[{"id":"172","name":"UseYearMonth should initialize years","location":{"start":{"column":6,"line":35}}},{"id":"173","name":"UseYearMonth should initialize months","location":{"start":{"column":6,"line":44}}},{"id":"174","name":"UseYearMonth changing year should change year","location":{"start":{"column":6,"line":57}}},{"id":"175","name":"UseYearMonth changing year should change months","location":{"start":{"column":6,"line":66}}},{"id":"176","name":"UseYearMonth changing month should change month","location":{"start":{"column":6,"line":82}}},{"id":"177","name":"UseYearMonth should not update months or month if year is undefined","location":{"start":{"column":6,"line":91}}},{"id":"178","name":"UseYearMonth should set error when API.getMonths fails","location":{"start":{"column":6,"line":102}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport useYearMonth from './UseYearMonth';\nimport { API } from '@services';\n\njest.mock('@services/Usage');\n\ndescribe('UseYearMonth', () => {\n    const expectedYears = [2013, 2012, 2011];\n\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    const expectedYearsCount = 3;\n\n    it('should initialize years', async () => {\n        const { result } = renderHook(() => useYearMonth());\n        await waitFor(() => {\n            expect(result.current.years.length).toEqual(expectedYearsCount);\n            expect(result.current.years).toEqual(expectedYears);\n            expect(result.current.year).toEqual(expectedYears[0]);\n        });\n    });\n\n    it('should initialize months', async () => {\n        const expectedCount = 11;\n        const expectedFirst = 'November';\n        const expectedLast = 'January';\n        const { result } = renderHook(() => useYearMonth());\n        await waitFor(() => {\n            expect(result.current.months.length).toEqual(expectedCount);\n            expect(result.current.months[0]).toEqual(expectedFirst);\n            expect(result.current.months[expectedCount - 1]).toEqual(expectedLast);\n            expect(result.current.month).toEqual(expectedFirst);\n        });\n    });\n\n    it('changing year should change year', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const { result } = renderHook(() => useYearMonth());\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.year).toEqual(expectedYear);\n        });\n    });\n\n    it('changing year should change months', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const expectedCount = 7;\n        const expectedFirst = 'December';\n        const expectedLast = 'June';\n        const { result } = renderHook(() => useYearMonth());\n\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.months.length).toEqual(expectedCount);\n            expect(result.current.months[0]).toEqual(expectedFirst);\n            expect(result.current.months[expectedCount - 1]).toEqual(expectedLast);\n            expect(result.current.month).toEqual(expectedFirst);\n        });\n    });\n\n    it('changing month should change month', async () => {\n        const expected = 'August';\n        const { result } = renderHook(() => useYearMonth());\n        await waitFor(() => {\n            act(() => result.current.setMonth(expected));\n            expect(result.current.month).toEqual(expected);\n        });\n    });\n\n    it('should not update months or month if year is undefined', async () => {\n        // scan-suspicious-ignore-next-line\n        const useYear = require('./UseYear');\n        const originalDefault = useYear.default;\n        useYear.default = jest.fn().mockReturnValue({ years: [], year: undefined, setYear: jest.fn() });\n        const { result } = renderHook(() => useYearMonth());\n        expect(result.current.months).toBeUndefined();\n        expect(result.current.month).toBeUndefined();\n        useYear.default = originalDefault;\n    });\n\n    it('should set error when API.getMonths fails', async () => {\n        const errorMessage = 'API Error';\n        jest.spyOn(API, 'getMonths').mockRejectedValueOnce(new Error(errorMessage));\n        const { result } = renderHook(() => useYearMonth());\n        await waitFor(() => {\n            expect(result.current.error).toEqual(errorMessage);\n        });\n    });\n});\n"},"src/features/bymonth/UseUsageByMonthGraph.test.js":{"tests":[{"id":"179","name":"UseUsageByMonthGraph should initialize years","location":{"start":{"column":6,"line":29}}},{"id":"180","name":"UseUsageByMonthGraph should initialize usage","location":{"start":{"column":6,"line":38}}},{"id":"181","name":"UseUsageByMonthGraph changing year should change year","location":{"start":{"column":6,"line":76}}},{"id":"182","name":"UseUsageByMonthGraph changing year should change usage","location":{"start":{"column":6,"line":85}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport useUsageByMonthGraph from './UseUsageByMonthGraph';\n\njest.mock('@services/Usage');\n\ndescribe('UseUsageByMonthGraph', () => {\n    const expectedYears = [2013, 2012, 2011];\n    const expectedYearsCount = 3;\n\n    it('should initialize years', async () => {\n        const { result } = renderHook(useUsageByMonthGraph);\n        await waitFor(() => {\n            expect(result.current.years.length).toEqual(expectedYearsCount);\n            expect(result.current.years).toEqual(expectedYears);\n            expect(result.current.year).toEqual(expectedYears[0]);\n        });\n    });\n\n    it('should initialize usage', async () => {\n        const expectedOptions = {\n            chart: {\n                id: 'usage-by-month',\n                toolbar: {\n                    show: false,\n                },\n            },\n            xaxis: {\n                categories: [\n                    'January',\n                    'February',\n                    'March',\n                    'April',\n                    'May',\n                    'June',\n                    'July',\n                    'August',\n                    'September',\n                    'October',\n                    'November',\n                ],\n            },\n        };\n        const expectedSeries = [\n            {\n                name: 'Total Usage',\n                data: [68, 57, 62, 58, 38, 84, 49, 37, 50, 49, 87],\n            },\n        ];\n        const { result } = renderHook(useUsageByMonthGraph);\n        await waitFor(() => {\n            expect(result.current.options).toEqual(expectedOptions);\n            expect(result.current.series).toEqual(expectedSeries);\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n\n    it('changing year should change year', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const { result } = renderHook(useUsageByMonthGraph);\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.year).toEqual(expectedYear);\n        });\n    });\n\n    it('changing year should change usage', async () => {\n        const expectedYear = expectedYears[expectedYearsCount - 1];\n        const expectedOptions = {\n            chart: {\n                id: 'usage-by-month',\n                toolbar: {\n                    show: false,\n                },\n            },\n            xaxis: {\n                categories: ['June', 'July', 'August', 'September', 'October', 'November', 'December'],\n            },\n        };\n        const expectedSeries = [\n            {\n                name: 'Total Usage',\n                data: [29, 23, 31, 16, 16, 12, 24],\n            },\n        ];\n        const { result } = renderHook(useUsageByMonthGraph);\n        await waitFor(() => {\n            act(() => result.current.setYear(expectedYear));\n            expect(result.current.options).toEqual(expectedOptions);\n            expect(result.current.series).toEqual(expectedSeries);\n        });\n    });\n});\n"},"src/components/table/Body.test.jsx":{"tests":[{"id":"183","name":"Body Component renders table rows and cells","location":{"start":{"column":6,"line":51}}},{"id":"184","name":"Body Component applies alternating row colors","location":{"start":{"column":6,"line":63}}},{"id":"185","name":"Body Component renders with ids","location":{"start":{"column":6,"line":72}}},{"id":"186","name":"Body Component renders no rows when values is empty","location":{"start":{"column":6,"line":78}}},{"id":"187","name":"Body Component renders no cells when cellInfos is empty","location":{"start":{"column":6,"line":83}}},{"id":"188","name":"Body Component renders correctly with a single value and custom cellInfos","location":{"start":{"column":6,"line":92}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport Body from './Body';\n\ndescribe('Body Component', () => {\n    const cellInfos = [\n        { id: 'name', label: 'Name', align: 'left', convert: null },\n        { id: 'age', label: 'Age', align: 'right', convert: (age) => `${age} years` },\n    ];\n\n    const values = [\n        { id: 1, name: 'John Doe', age: 28 },\n        { id: 2, name: 'Jane Smith', age: 32 },\n        { id: 3, name: 'John Smith', age: 30 },\n    ];\n\n    const defaultProps = {\n        prefix: 'test',\n        cellInfos,\n        values,\n    };\n\n    const renderComponent = (props = defaultProps) => {\n        return render(\n            <"+"table>\n                <"+"Body {...props} />\n            <"+"/table>\n        );\n    };\n\n    it('renders table rows and cells', () => {\n        renderComponent();\n        values.forEach((value, index) => {\n            const row = screen.getByTestId(`test-data-${index}`);\n            expect(row).toBeInTheDocument();\n            cellInfos.forEach((cellInfo) => {\n                const cell = screen.getByText(cellInfo.convert ? cellInfo.convert(value[cellInfo.id]) : value[cellInfo.id]);\n                expect(cell).toBeInTheDocument();\n            });\n        });\n    });\n\n    it('applies alternating row colors', () => {\n        renderComponent();\n        values.forEach((value, index) => {\n            const row = screen.getByTestId(`test-data-${index}`);\n            const expectedBackgroundColor = index % 2 ? 'ghostwhite' : 'white';\n            expect(row).toHaveStyle(`background: ${expectedBackgroundColor}`);\n        });\n    });\n\n    it('renders with ids', () => {\n        renderComponent();\n        expect(screen.getByTestId('test-data-0')).toBeInTheDocument();\n        expect(screen.getByTestId('test-data-1')).toBeInTheDocument();\n    });\n\n    it('renders no rows when values is empty', () => {\n        renderComponent({ ...defaultProps, values: [] });\n        expect(screen.queryByTestId('test-data-0')).not.toBeInTheDocument();\n    });\n\n    it('renders no cells when cellInfos is empty', () => {\n        renderComponent({ ...defaultProps, cellInfos: [] });\n        values.forEach((_, index) => {\n            const row = screen.getByTestId(`test-data-${index}`);\n            expect(row).toBeInTheDocument();\n            expect(row.querySelectorAll('td').length).toBe(0);\n        });\n    });\n\n    it('renders correctly with a single value and custom cellInfos', () => {\n        const customCellInfos = [\n            { id: 'username', label: 'Username', align: 'left', convert: (u) => u.toUpperCase() },\n            { id: 'score', label: 'Score', align: 'right', convert: null },\n        ];\n        const customValues = [{ id: 10, username: 'alice', score: 99 }];\n        const props = { prefix: 'custom', cellInfos: customCellInfos, values: customValues };\n        renderComponent(props);\n        expect(screen.getByText('ALICE')).toBeInTheDocument();\n        expect(screen.getByText('99')).toBeInTheDocument();\n    });\n});\n"},"src/components/navigation/UseNavigation.test.js":{"tests":[{"id":"189","name":"UseNavigation should initialize","location":{"start":{"column":6,"line":41}}},{"id":"190","name":"UseNavigation should default to first path if not found","location":{"start":{"column":6,"line":48}}},{"id":"191","name":"UseNavigation should not change index if setIndex is called with invalid value","location":{"start":{"column":6,"line":55}}},{"id":"192","name":"UseNavigation should reset index to 0 if menu changes and current index is out of bounds","location":{"start":{"column":6,"line":70}}},{"id":"193","name":"UseNavigation should keep index if menu changes but current index is still valid","location":{"start":{"column":6,"line":80}}},{"id":"194","name":"UseNavigation should handle repeated setIndex calls to the same value","location":{"start":{"column":6,"line":90}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { renderHook, act } from '@testing-library/react';\nimport useNavigation from './UseNavigation';\n\nlet mockPathname = '/pathname2';\n\njest.mock('react-router', () => ({\n    ...jest.requireActual('react-router'),\n    useLocation: () => ({\n        pathname: mockPathname,\n    }),\n}));\n\nconst mockUseLocation = (pathname) => {\n    mockPathname = pathname;\n};\n\ndescribe('UseNavigation', () => {\n    beforeEach(() => {\n        mockPathname = '/pathname2';\n    });\n\n    it('should initialize', () => {\n        const menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }, { pathname: '/pathname3' }];\n        const { result } = renderHook(() => useNavigation(menu));\n\n        expect(result.current.index).toEqual(1);\n    });\n\n    it('should default to first path if not found', () => {\n        const menu = [{ pathname: '/pathname1' }, { pathname: '/pathname3' }];\n        const { result } = renderHook(() => useNavigation(menu));\n\n        expect(result.current.index).toEqual(0);\n    });\n\n    it('should not change index if setIndex is called with invalid value', () => {\n        mockUseLocation('/pathname1');\n        const menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }];\n        const { result } = renderHook(() => useNavigation(menu));\n        expect(result.current.index).toEqual(0);\n        act(() => {\n            result.current.setIndex(-1);\n        });\n        expect(result.current.index).toEqual(0);\n        act(() => {\n            result.current.setIndex(100);\n        });\n        expect(result.current.index).toEqual(0);\n    });\n\n    it('should reset index to 0 if menu changes and current index is out of bounds', () => {\n        mockUseLocation('/pathname2');\n        let menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }];\n        const { result, rerender } = renderHook(() => useNavigation(menu));\n        expect(result.current.index).toEqual(1);\n        menu = [{ pathname: '/pathname1' }];\n        rerender();\n        expect(result.current.index).toEqual(0);\n    });\n\n    it('should keep index if menu changes but current index is still valid', () => {\n        mockUseLocation('/pathname2');\n        let menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }, { pathname: '/pathname3' }];\n        const { result, rerender } = renderHook(() => useNavigation(menu));\n        expect(result.current.index).toEqual(1);\n        menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }, { pathname: '/pathname4' }];\n        rerender();\n        expect(result.current.index).toEqual(1);\n    });\n\n    it('should handle repeated setIndex calls to the same value', () => {\n        mockUseLocation('/pathname1');\n        const menu = [{ pathname: '/pathname1' }, { pathname: '/pathname2' }];\n        const { result } = renderHook(() => useNavigation(menu));\n        expect(result.current.index).toEqual(0);\n        act(() => {\n            result.current.setIndex(0);\n            result.current.setIndex(0);\n        });\n        expect(result.current.index).toEqual(0);\n    });\n});\n"},"src/services/Usage.test.js":{"tests":[{"id":"195","name":"Usage should return data","location":{"start":{"column":6,"line":37}}},{"id":"196","name":"Usage should throw error when status is not OK","location":{"start":{"column":6,"line":102}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport fetchMock from 'jest-fetch-mock';\nimport { fromIPv4 } from '@utils';\nimport usage from './Usage';\n\nfetchMock.enableMocks();\n\ndescribe('Usage', () => {\n    beforeEach(() => {\n        fetch.resetMocks();\n        fetch.doMock();\n        jest.useFakeTimers();\n    });\n\n    afterEach(() => {\n        jest.useRealTimers();\n    });\n\n    it('should return data', async () => {\n        const response =\n            '2011-06,192.168.1.14,00:24:8D:28:F2:9A,\\rCOMPUTER-1,202809,11512,1307160300,1308013207\\n' +\n            '\\r\\n' +\n            '2012-01,192.168.1.20,00:1A:E9:92:A5:5F,COMPUTER-8,23120,428,1325970007,\\r1325970007\\n' +\n            '\\r\\n' +\n            '\\r\\n' +\n            '2013-01,192.168.1.16,00:90:A9:C6:19:5B,COMPUTER-11,\\r212959,10700,1357322402,1359313201\\n';\n        const expected = [\n            {\n                IP: fromIPv4('192.168.1.14'),\n                MAC: '00:24:8D:28:F2:9A',\n                average: 21432.1,\n                days: 10,\n                download: 202809,\n                firstSeen: 1307160300,\n                id: 0,\n                lastSeen: 1308013207,\n                month: 6,\n                total: 214321,\n                upload: 11512,\n                user: 'COMPUTER-1',\n                year: 2011,\n            },\n            {\n                IP: fromIPv4('192.168.1.20'),\n                MAC: '00:1A:E9:92:A5:5F',\n                average: 23548,\n                days: 1,\n                download: 23120,\n                firstSeen: 1325970007,\n                id: 2,\n                lastSeen: 1325970007,\n                month: 1,\n                total: 23548,\n                upload: 428,\n                user: 'COMPUTER-8',\n                year: 2012,\n            },\n            {\n                IP: fromIPv4('192.168.1.16'),\n                MAC: '00:90:A9:C6:19:5B',\n                average: 9319.125,\n                days: 24,\n                download: 212959,\n                firstSeen: 1357322402,\n                id: 5,\n                lastSeen: 1359313201,\n                month: 1,\n                total: 223659,\n                upload: 10700,\n                user: 'COMPUTER-11',\n                year: 2013,\n            },\n        ];\n        fetch.mockResponseOnce(response);\n        const data = await usage.request('xyz');\n        expect(data.length).toEqual(expected.length);\n        expected.forEach((item, index) => {\n            expect(data[index]).toEqual(item);\n        });\n        expect(fetch).toHaveBeenCalled();\n        expect(fetch).toHaveBeenCalledWith('xyz/usage.db');\n    });\n\n    it('should throw error when status is not OK', async () => {\n        fetch.mockResponseOnce('', { status: 400, statusText: 'Bad request' });\n        try {\n            await usage.request('xyz');\n            expect(true).toBeFalsy();\n        } catch (e) {\n            expect(e.message).toEqual('400 Bad request');\n        }\n    });\n});\n"},"src/features/bymonth/UsageByMonthGraph.test.jsx":{"tests":[{"id":"197","name":"UsageByMonthGraph renders loading state","location":{"start":{"column":6,"line":53}}},{"id":"198","name":"UsageByMonthGraph renders graph when data is loaded","location":{"start":{"column":6,"line":59}}},{"id":"199","name":"UsageByMonthGraph renders year selector","location":{"start":{"column":6,"line":64}}},{"id":"200","name":"UsageByMonthGraph handles year selector","location":{"start":{"column":6,"line":72}}},{"id":"201","name":"UsageByMonthGraph displays correct graph options and series","location":{"start":{"column":6,"line":81}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { fireEvent, render, screen, within } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport UsageByMonthGraph from './UsageByMonthGraph';\nimport useUsageByMonthGraph from './UseUsageByMonthGraph';\n\njest.mock('@components/graph/Graph');\njest.mock('@features/bymonth/UseUsageByMonthGraph');\n\ndescribe('UsageByMonthGraph', () => {\n    const data = {\n        options: {},\n        series: [],\n        years: [2020, 2021, 2022],\n        year: 2021,\n        setYear: jest.fn(),\n        loading: false,\n    };\n\n    beforeEach(() => {\n        useUsageByMonthGraph.mockReturnValue(data);\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByMonthGraph {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByMonthGraph.mockReturnValue({ ...data, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n    });\n\n    it('renders graph when data is loaded', () => {\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n    });\n\n    it('renders year selector', () => {\n        renderComponent();\n        const container = screen.getByTestId('month-year-graph');\n        expect(container).toBeInTheDocument();\n        const { getByText } = within(container);\n        expect(getByText(2021)).toBeInTheDocument();\n    });\n\n    it('handles year selector', () => {\n        renderComponent();\n        // scan-suspicious-ignore-next-line\n        const container = document.querySelector('#month-year-graph');\n        fireEvent.mouseDown(container);\n        fireEvent.click(screen.getByRole('option', { name: 2022 }));\n        expect(useUsageByMonthGraph().setYear).toHaveBeenCalledWith(2022);\n    });\n\n    it('displays correct graph options and series', () => {\n        useUsageByMonthGraph.mockReturnValue({\n            options: { chart: { id: 'test-chart' } },\n            series: [{ name: 'test-series', data: [1, 2, 3] }],\n            loading: false,\n        });\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('Graph');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('{\"chart\":{\"id\":\"test-chart\"}}');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('[{\"name\":\"test-series\",\"data\":[1,2,3]}]');\n    });\n});\n"},"src/components/navigation/Navigation.test.jsx":{"tests":[{"id":"202","name":"Navigation renders navigation actions from menu","location":{"start":{"column":6,"line":42}}},{"id":"203","name":"Navigation changes route on navigation action click","location":{"start":{"column":6,"line":52}}},{"id":"204","name":"Navigation renders with correct props for each BottomNavigationAction","location":{"start":{"column":6,"line":60}}},{"id":"205","name":"Navigation calls setIndex with the new route index when handleChange is triggered","location":{"start":{"column":6,"line":71}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\nimport React from 'react';\nimport { render, screen, fireEvent } from '@testing-library/react';\nimport { MemoryRouter } from 'react-router';\nimport '@testing-library/jest-dom';\nimport Navigation from './Navigation';\n\ndescribe('Navigation', () => {\n    const menu = [\n        { id: 'home', pathname: '/home', label: 'Home', icon: <"+"div>HomeIcon<"+"/div> },\n        { id: 'about', pathname: '/about', label: 'About', icon: <"+"div>AboutIcon<"+"/div> },\n    ];\n\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    const renderComponent = () =>\n        render(\n            <"+"MemoryRouter initialEntries={['/']}>\n                <"+"Navigation menu={menu} />\n            <"+"/MemoryRouter>\n        );\n\n    it('renders navigation actions from menu', () => {\n        renderComponent();\n        menu.forEach((menuItem) => {\n            expect(screen.getByTestId(menuItem.id)).toBeInTheDocument();\n            expect(screen.getByText(menuItem.label)).toBeInTheDocument();\n        });\n        expect(screen.getByTestId('home')).toHaveClass('Mui-selected');\n        expect(screen.getByTestId('about')).not.toHaveClass('Mui-selected');\n    });\n\n    it('changes route on navigation action click', () => {\n        renderComponent();\n        const aboutNavAction = screen.getByTestId('about');\n        fireEvent.click(aboutNavAction);\n        expect(screen.getByTestId('home')).not.toHaveClass('Mui-selected');\n        expect(screen.getByTestId('about')).toHaveClass('Mui-selected');\n    });\n\n    it('renders with correct props for each BottomNavigationAction', () => {\n        renderComponent();\n        const homeNavAction = screen.getByTestId('home');\n        const aboutNavAction = screen.getByTestId('about');\n\n        expect(homeNavAction).toHaveAttribute('id', 'home');\n        expect(homeNavAction).toHaveAttribute('data-testid', 'home');\n        expect(aboutNavAction).toHaveAttribute('id', 'about');\n        expect(aboutNavAction).toHaveAttribute('data-testid', 'about');\n    });\n\n    it('calls setIndex with the new route index when handleChange is triggered', () => {\n        const setIndex = jest.fn();\n        // scan-suspicious-ignore-next-line\n        jest.spyOn(require('./UseNavigation'), 'default').mockReturnValue({ index: 0, setIndex });\n        renderComponent();\n        const aboutNavAction = screen.getByTestId('about');\n        fireEvent.click(aboutNavAction);\n        expect(setIndex).toHaveBeenCalledWith(1);\n        jest.restoreAllMocks();\n    });\n});\n"},"src/menu/Menu.test.jsx":{"tests":[{"id":"206","name":"Menu id","location":{"start":{"column":6,"line":28}}},{"id":"207","name":"Menu element","location":{"start":{"column":6,"line":37}}},{"id":"208","name":"Menu pathname","location":{"start":{"column":6,"line":46}}},{"id":"209","name":"Menu label","location":{"start":{"column":6,"line":55}}},{"id":"210","name":"Menu icon","location":{"start":{"column":6,"line":64}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on
