ect('By Month').toEqual(menu[2].label);\n        expect('By Month Graph').toEqual(menu[3].label);\n        expect('By Year').toEqual(menu[4].label);\n        expect('By Year Graph').toEqual(menu[5].label);\n    });\n\n    it('icon', () => {\n        expect(<"+"Person />).toEqual(menu[0].icon);\n        expect(<"+"ShowChart />).toEqual(menu[1].icon);\n        expect(<"+"CalendarToday />).toEqual(menu[2].icon);\n        expect(<"+"Timeline />).toEqual(menu[3].icon);\n        expect(<"+"CalendarViewDay />).toEqual(menu[4].icon);\n        expect(<"+"Timeline />).toEqual(menu[5].icon);\n    });\n});\n"},"src/features/byyear/UseUsageByYear.test.js":{"tests":[{"id":"211","name":"UseUsageByYear should initialize","location":{"start":{"column":6,"line":31}}},{"id":"212","name":"UseUsageByYear should handle API returning empty array","location":{"start":{"column":6,"line":56}}},{"id":"213","name":"UseUsageByYear should handle API returning null","location":{"start":{"column":6,"line":65}}},{"id":"214","name":"UseUsageByYear should set error when API.getUsageByYear fails","location":{"start":{"column":6,"line":74}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { renderHook, waitFor } from '@testing-library/react';\nimport { API } from '@services';\nimport { useUsageByYear } from '.';\n\njest.mock('@services/Usage');\n\ndescribe('UseUsageByYear', () => {\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    it('should initialize', async () => {\n        const expectedCount = 3;\n        const expectedFirst = {\n            average: 1752605.622,\n            days: 365,\n            download: 603928097,\n            id: 2013,\n            total: 639701052,\n            upload: 35772955,\n        };\n        const expectedLast = {\n            average: 412831.811,\n            days: 365,\n            download: 139938627,\n            id: 2011,\n            total: 150683611,\n            upload: 10744984,\n        };\n        const { result } = renderHook(useUsageByYear);\n        await waitFor(() => expect(result.current.loading).toBeFalsy());\n        expect(result.current.data.length).toEqual(expectedCount);\n        expect(result.current.data[0]).toEqual(expectedFirst);\n        expect(result.current.data[expectedCount - 1]).toEqual(expectedLast);\n    });\n\n    it('should handle API returning empty array', async () => {\n        jest.spyOn(API, 'getUsageByYear').mockResolvedValueOnce([]);\n        const { result } = renderHook(useUsageByYear);\n        await waitFor(() => {\n            expect(result.current.data).toEqual([]);\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n\n    it('should handle API returning null', async () => {\n        jest.spyOn(API, 'getUsageByYear').mockResolvedValueOnce(null);\n        const { result } = renderHook(useUsageByYear);\n        await waitFor(() => {\n            expect(result.current.data).toBeNull();\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n\n    it('should set error when API.getUsageByYear fails', async () => {\n        const errorMessage = 'API Error';\n        jest.spyOn(API, 'getUsageByYear').mockRejectedValueOnce(new Error(errorMessage));\n        const { result } = renderHook(useUsageByYear);\n        await waitFor(() => {\n            expect(result.current.error).toEqual(errorMessage);\n            expect(result.current.loading).toBeFalsy();\n        });\n    });\n});\n"},"src/App.test.jsx":{"tests":[{"id":"215","name":"App renders the landing page","location":{"start":{"column":6,"line":57}}},{"id":"216","name":"App renders the landing page with default props","location":{"start":{"column":6,"line":68}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen, waitForElementToBeRemoved } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport { Settings } from 'luxon';\nimport App from './App';\nimport menu from './menu/Menu';\n\njest.mock('./services/Usage');\n\ndescribe('App', () => {\n    const originalZone = Settings.defaultZone;\n    const originalLocale = Settings.defaultLocale;\n\n    beforeEach(() => {\n        Settings.defaultZone = 'America/New_York';\n        Settings.defaultLocale = 'en-US';\n    });\n\n    afterEach(() => {\n        Settings.defaultZone = originalZone;\n        Settings.defaultLocale = originalLocale;\n    });\n\n    const name = 'Bandwidth Monitor Test Name';\n    const version = '1.1.1';\n    const currentTime = 'October 20, 2020, 11:25:35 AM EDT';\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"App {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders the landing page', async () => {\n        renderComponent({ name: name, version: version, currentTime: currentTime });\n        expect(screen.getByTestId('app-title')).toHaveTextContent(name);\n        expect(screen.getByTestId('app-version')).toHaveTextContent(version);\n        expect(screen.getByTestId('app-footer2')).toHaveTextContent(`This page was generated on ${currentTime}`);\n        menu.forEach((menuItem) => {\n            expect(screen.getByTestId(menuItem.id)).toHaveTextContent(menuItem.label);\n        });\n        await waitForElementToBeRemoved(() => screen.queryByText('Loading...'));\n    });\n\n    it('renders the landing page with default props', async () => {\n        renderComponent();\n        expect(screen.getByTestId('app-title')).toHaveTextContent('Bandwidth Monitor');\n        expect(screen.getByTestId('app-footer2')).toHaveTextContent('This page was generated on ');\n        menu.forEach((menuItem) => {\n            expect(screen.getByTestId(menuItem.id)).toHaveTextContent(menuItem.label);\n        });\n        await waitForElementToBeRemoved(() => screen.queryByText('Loading...'));\n    });\n});\n"},"src/hooks/UseYear.test.js":{"tests":[{"id":"217","name":"UseYear should initialize","location":{"start":{"column":6,"line":33}}},{"id":"218","name":"UseYear changing year should change year","location":{"start":{"column":6,"line":42}}},{"id":"219","name":"UseYear should not change year if set to a value not in years","location":{"start":{"column":6,"line":51}}},{"id":"220","name":"UseYear should not change year if set to the current year","location":{"start":{"column":6,"line":61}}},{"id":"221","name":"UseYear should set error when API fails","location":{"start":{"column":6,"line":70}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport useYear from './UseYear';\nimport { API } from '@services';\n\njest.mock('@services/Usage');\n\ndescribe('UseYear', () => {\n    const expectedYears = [2013, 2012, 2011];\n\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    it('should initialize', async () => {\n        const { result } = renderHook(useYear);\n        await waitFor(() => {\n            expect(result.current.years.length).toEqual(expectedYears.length);\n            expect(result.current.years).toEqual(expectedYears);\n            expect(result.current.year).toEqual(expectedYears[0]);\n        });\n    });\n\n    it('changing year should change year', async () => {\n        const expected = expectedYears[expectedYears.length - 1];\n        const { result } = renderHook(useYear);\n        await waitFor(() => {\n            act(() => result.current.setYear(expected));\n            expect(result.current.year).toEqual(expected);\n        });\n    });\n\n    it('should not change year if set to a value not in years', async () => {\n        const invalidYear = 1999;\n        const { result } = renderHook(useYear);\n        await waitFor(() => {\n            const initialYear = result.current.year;\n            act(() => result.current.setYear(invalidYear));\n            expect(result.current.year).toEqual(initialYear);\n        });\n    });\n\n    it('should not change year if set to the current year', async () => {\n        const { result } = renderHook(useYear);\n        await waitFor(() => {\n            const initialYear = result.current.year;\n            act(() => result.current.setYear(initialYear));\n            expect(result.current.year).toEqual(initialYear);\n        });\n    });\n\n    it('should set error when API fails', async () => {\n        const errorMessage = 'API Error';\n        jest.spyOn(API, 'getYears').mockRejectedValueOnce(new Error(errorMessage));\n        const { result } = renderHook(useYear);\n        await waitFor(() => {\n            expect(result.current.error).toEqual(errorMessage);\n            expect(result.current.years).toBeUndefined();\n            expect(result.current.year).toBeUndefined();\n        });\n    });\n});\n"},"src/hooks/UseSort.test.js":{"tests":[{"id":"222","name":"UseSort Descending should initialize","location":{"start":{"column":10,"line":25}}},{"id":"223","name":"UseSort Descending changing ascending should change ascending","location":{"start":{"column":10,"line":33}}},{"id":"224","name":"UseSort Descending changing orderBy should change orderBy","location":{"start":{"column":10,"line":41}}},{"id":"225","name":"UseSort Ascending should initialize","location":{"start":{"column":10,"line":51}}},{"id":"226","name":"UseSort Ascending changing ascending should change ascending","location":{"start":{"column":10,"line":59}}},{"id":"227","name":"UseSort Ascending changing orderBy should change orderBy","location":{"start":{"column":10,"line":67}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport { useSortAsc, useSortDesc } from './UseSort';\n\ndescribe('UseSort', () => {\n    describe('Descending', () => {\n        it('should initialize', async () => {\n            const { result } = renderHook(() => useSortDesc('xyz'));\n            await waitFor(() => {\n                expect(result.current.ascending).toBeFalsy();\n                expect(result.current.orderBy).toEqual('xyz');\n            });\n        });\n\n        it('changing ascending should change ascending', async () => {\n            const { result } = renderHook(() => useSortDesc('xyz'));\n            await waitFor(() => {\n                act(() => result.current.setAscending(true));\n                expect(result.current.ascending).toBeTruthy();\n            });\n        });\n\n        it('changing orderBy should change orderBy', async () => {\n            const { result } = renderHook(() => useSortDesc('xyz'));\n            await waitFor(() => {\n                act(() => result.current.setOrderBy('ABC'));\n                expect(result.current.orderBy).toEqual('ABC');\n            });\n        });\n    });\n\n    describe('Ascending', () => {\n        it('should initialize', async () => {\n            const { result } = renderHook(() => useSortAsc('xyz'));\n            await waitFor(() => {\n                expect(result.current.ascending).toBeTruthy();\n                expect(result.current.orderBy).toEqual('xyz');\n            });\n        });\n\n        it('changing ascending should change ascending', async () => {\n            const { result } = renderHook(() => useSortAsc('xyz'));\n            await waitFor(() => {\n                act(() => result.current.setAscending(false));\n                expect(result.current.ascending).toBeFalsy();\n            });\n        });\n\n        it('changing orderBy should change orderBy', async () => {\n            const { result } = renderHook(() => useSortAsc('xyz'));\n            await waitFor(() => {\n                act(() => result.current.setOrderBy('ABC'));\n                expect(result.current.orderBy).toEqual('ABC');\n            });\n        });\n    });\n});\n"},"src/utils/ConversionUtils.test.js":{"tests":[{"id":"228","name":"ConversionUtils toMonth should return december month as full name","location":{"start":{"column":10,"line":25}}},{"id":"229","name":"ConversionUtils toMonth should return january month as full name","location":{"start":{"column":10,"line":31}}},{"id":"230","name":"ConversionUtils timeToDate should return month as full name","location":{"start":{"column":10,"line":39}}},{"id":"231","name":"ConversionUtils usageInGBytes should return value in GBytes","location":{"start":{"column":10,"line":48}}},{"id":"232","name":"ConversionUtils toPercent should return value with one decimal","location":{"start":{"column":10,"line":56}}},{"id":"233","name":"ConversionUtils toIPv4 should return IPv4 coverted from number","location":{"start":{"column":10,"line":64}}},{"id":"234","name":"ConversionUtils fromIPv4 should return number coverted from IPv4","location":{"start":{"column":10,"line":72}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { DateTime } from 'luxon';\nimport { fromIPv4, timeToDate, toIPv4, toMonth, toPercent, usageInGBytes } from './ConversionUtils';\n\ndescribe('ConversionUtils', () => {\n    describe('toMonth', () => {\n        it('should return december month as full name', () => {\n            const expected = 'December';\n            const actual = toMonth(12);\n            expect(actual).toEqual(expected);\n        });\n\n        it('should return january month as full name', () => {\n            const expected = 'January';\n            const actual = toMonth(1);\n            expect(actual).toEqual(expected);\n        });\n    });\n\n    describe('timeToDate', () => {\n        it('should return month as full name', () => {\n            const date = DateTime.local(2011, 6, 15, 8, 30, 25);\n            const expected = 'Jun 15, 2011 08:30';\n            const actual = timeToDate(date.toSeconds());\n            expect(actual).toEqual(expected);\n        });\n    });\n\n    describe('usageInGBytes', () => {\n        it('should return value in GBytes', () => {\n            const expected = 123.457;\n            const actual = Number(usageInGBytes(123456789));\n            expect(actual).toEqual(expected);\n        });\n    });\n\n    describe('toPercent', () => {\n        it('should return value with one decimal', () => {\n            const expected = '123.5%';\n            const actual = toPercent(123.456);\n            expect(actual).toEqual(expected);\n        });\n    });\n\n    describe('toIPv4', () => {\n        it('should return IPv4 coverted from number', () => {\n            const expected = '12.255.0.6';\n            const actual = toIPv4(218038278);\n            expect(actual).toEqual(expected);\n        });\n    });\n\n    describe('fromIPv4', () => {\n        it('should return number coverted from IPv4', () => {\n            const expected = 218038278;\n            const actual = fromIPv4('12.255.0.6');\n            expect(actual).toEqual(expected);\n        });\n    });\n});\n"},"src/features/byyear/UsageByYearGraph.test.jsx":{"tests":[{"id":"235","name":"UsageByYearGraph renders loading state","location":{"start":{"column":6,"line":50}}},{"id":"236","name":"UsageByYearGraph renders graph when data is loaded","location":{"start":{"column":6,"line":56}}},{"id":"237","name":"UsageByYearGraph displays correct graph options and series","location":{"start":{"column":6,"line":61}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport UsageByYearGraph from './UsageByYearGraph';\nimport useUsageByYearGraph from './UseUsageByYearGraph';\n\njest.mock('@components/graph/Graph');\njest.mock('@features/byyear/UseUsageByYearGraph');\n\ndescribe('UsageByYearGraph', () => {\n    const data = {\n        options: {},\n        series: [],\n        loading: false,\n    };\n\n    beforeEach(() => {\n        useUsageByYearGraph.mockReturnValue(data);\n    });\n\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"UsageByYearGraph {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading state', () => {\n        useUsageByYearGraph.mockReturnValue({ ...data, loading: true });\n        renderComponent();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n    });\n\n    it('renders graph when data is loaded', () => {\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n    });\n\n    it('displays correct graph options and series', () => {\n        useUsageByYearGraph.mockReturnValue({\n            options: { chart: { id: 'test-chart' } },\n            series: [{ name: 'test-series', data: [1, 2, 3] }],\n            loading: false,\n        });\n        renderComponent();\n        expect(screen.getByTestId('test-graph-id')).toBeInTheDocument();\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('Graph');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('{\"chart\":{\"id\":\"test-chart\"}}');\n        expect(screen.getByTestId('test-graph-id')).toHaveTextContent('[{\"name\":\"test-series\",\"data\":[1,2,3]}]');\n    });\n});\n"},"src/components/table/UsageTable.test.jsx":{"tests":[{"id":"238","name":"UsageTable renders table with header, body, footer, and pagination","location":{"start":{"column":6,"line":41}}},{"id":"239","name":"UsageTable renders table without footer when showFooter is false","location":{"start":{"column":6,"line":60}}}],"source":"import React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport UsageTable from './UsageTable';\n\nconst cellInfos = [\n    { id: 'id', label: 'ID', align: 'left' },\n    { id: 'value', label: 'Value', align: 'right' },\n];\n\nconst paginationProps = {\n    'data-testid': 'test-pagination',\n    id: 'test-pagination',\n    colSpan: 2,\n    count: 2,\n    minimum: 1,\n    rowsPerPage: 2,\n    page: 0,\n    onPageChange: jest.fn(),\n    onRowsPerPageChange: jest.fn(),\n};\n\nconst headerProps = {\n    onRequestSort: jest.fn(),\n    ascending: true,\n    orderBy: 'id',\n};\n\nconst bodyProps = {\n    values: [\n        { id: 'row1', value: 10 },\n        { id: 'row2', value: 20 },\n    ],\n};\n\nconst footerProps = {\n    values: { id: 'total', value: 30 },\n};\n\ndescribe('UsageTable', () => {\n    it('renders table with header, body, footer, and pagination', () => {\n        render(\n            <"+"UsageTable\n                prefix=\"test\"\n                cellInfos={cellInfos}\n                paginationProps={paginationProps}\n                headerProps={headerProps}\n                bodyProps={bodyProps}\n                footerProps={footerProps}\n                showFooter={true}\n            />\n        );\n        expect(screen.getByTestId('test-pagination')).toBeInTheDocument();\n        expect(screen.getByTestId('test-header')).toBeInTheDocument();\n        expect(screen.getByTestId('test-data-0')).toBeInTheDocument();\n        expect(screen.getByTestId('test-data-1')).toBeInTheDocument();\n        expect(screen.getByTestId('test-footer')).toBeInTheDocument();\n    });\n\n    it('renders table without footer when showFooter is false', () => {\n        render(\n            <"+"UsageTable\n                prefix=\"test\"\n                cellInfos={cellInfos}\n                paginationProps={paginationProps}\n                headerProps={headerProps}\n                bodyProps={bodyProps}\n                showFooter={false}\n            />\n        );\n        expect(screen.getByTestId('test-pagination')).toBeInTheDocument();\n        expect(screen.getByTestId('test-header')).toBeInTheDocument();\n        expect(screen.getByTestId('test-data-0')).toBeInTheDocument();\n        expect(screen.getByTestId('test-data-1')).toBeInTheDocument();\n        expect(screen.queryByTestId('test-footer')).not.toBeInTheDocument();\n    });\n});\n"},"src/components/table/Footer.test.jsx":{"tests":[{"id":"240","name":"Footer renders footer row with totals","location":{"start":{"column":6,"line":54}}},{"id":"241","name":"Footer renders footer with ids","location":{"start":{"column":6,"line":65}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport Footer from './Footer';\n\ndescribe('Footer', () => {\n    const cellInfos = [\n        { id: 'name', label: 'Name', align: 'left', footer: true },\n        { id: 'value', label: 'Value', align: 'left', footer: true },\n        { id: 'novalue', label: 'NoValue', align: 'left', footer: false },\n        { id: 'total', label: 'Total', align: 'right', footer: true },\n    ];\n\n    const values = {\n        name: '',\n        value: 'text',\n        novalue: 'no-text',\n        total: 100,\n    };\n\n    const defaultProps = {\n        prefix: 'test',\n        cellInfos,\n        values,\n    };\n\n    const renderComponent = (props = defaultProps) => {\n        return render(\n            <"+"table>\n                <"+"Footer {...props} />\n            <"+"/table>\n        );\n    };\n\n    it('renders footer row with totals', () => {\n        renderComponent();\n        const footerRow = screen.getByTestId('test-footer');\n        expect(footerRow).toBeInTheDocument();\n        const footerCells = screen.getAllByRole('columnheader');\n        expect(footerCells[0]).toHaveTextContent('Totals');\n        expect(footerCells[1]).toHaveTextContent('text');\n        expect(footerCells[2]).toHaveTextContent('');\n        expect(footerCells[3]).toHaveTextContent('100');\n    });\n\n    it('renders footer with ids', () => {\n        renderComponent();\n        expect(screen.getByTestId('test-footer')).toBeInTheDocument();\n    });\n});\n"},"src/components/navigation/BWMonRoutes.test.jsx":{"tests":[{"id":"242","name":"BWMonRoutes renders default route","location":{"start":{"column":6,"line":45}}},{"id":"243","name":"BWMonRoutes renders specific route","location":{"start":{"column":6,"line":50}}},{"id":"244","name":"BWMonRoutes renders PageNotFound for unknown route","location":{"start":{"column":6,"line":55}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport { MemoryRouter } from 'react-router';\nimport '@testing-library/jest-dom';\nimport BWMonRoutes from './BWMonRoutes';\n\nconst MockComponent = ({ text }) => <"+"div>{text}<"+"/div>;\n\ndescribe('BWMonRoutes', () => {\n    const menu = [\n        { pathname: '/page1', element: <"+"MockComponent text=\"Page 1\" /> },\n        { pathname: '/page2', element: <"+"MockComponent text=\"Page 2\" /> },\n    ];\n\n    afterEach(() => {\n        jest.restoreAllMocks();\n    });\n\n    const renderComponent = (props) =>\n        render(\n            <"+"MemoryRouter initialEntries={props}>\n                <"+"BWMonRoutes menu={menu} />\n            <"+"/MemoryRouter>\n        );\n\n    it('renders default route', () => {\n        renderComponent(['/']);\n        expect(screen.getByText('Page 1')).toBeInTheDocument();\n    });\n\n    it('renders specific route', () => {\n        renderComponent(['/page2']);\n        expect(screen.getByText('Page 2')).toBeInTheDocument();\n    });\n\n    it('renders PageNotFound for unknown route', () => {\n        jest.spyOn(console, 'warn').mockImplementation(() => {});\n        const { container } = renderComponent(['/page3']);\n        expect(container.firstChild).toBeNull();\n    });\n});\n"},"src/components/inputs/DropDown.test.jsx":{"tests":[{"id":"245","name":"DropDown Component renders dropdown with provided items","location":{"start":{"column":6,"line":30}}},{"id":"246","name":"DropDown Component does not render anything when items are null","location":{"start":{"column":6,"line":37}}},{"id":"247","name":"DropDown Component does not render anything when value is not provided","location":{"start":{"column":6,"line":42}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport DropDown from './DropDown';\n\ndescribe('DropDown Component', () => {\n    const handleChange = (_event) => {\n        // handle change\n    };\n\n    it('renders dropdown with provided items', () => {\n        const value = 'ZYXUW';\n        render(<"+"DropDown onChange={handleChange} items={['ABC', 'ZYXUW', 'WGKF']} value={value} />);\n        expect(screen.getByRole('combobox')).toHaveTextContent(value);\n        expect(screen.getByRole('combobox')).toHaveClass('MuiSelect-select');\n    });\n\n    it('does not render anything when items are null', () => {\n        const { container } = render(<"+"DropDown onChange={handleChange} value=\"Item 1\" />);\n        expect(container.firstChild).toBeNull();\n    });\n\n    it('does not render anything when value is not provided', () => {\n        const { container } = render(<"+"DropDown onChange={handleChange} items={['ABC', 'ZYXUW', 'WGKF']} />);\n        expect(container.firstChild).toBeNull();\n    });\n});\n"},"src/components/messages/Message.test.jsx":{"tests":[{"id":"248","name":"Message Component renders the message with the correct severity","location":{"start":{"column":6,"line":36}}},{"id":"249","name":"Message Component does not render anything when message is null","location":{"start":{"column":6,"line":43}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport Message from './Message';\n\ndescribe('Message Component', () => {\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"Message {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders the message with the correct severity', () => {\n        const props = { severity: 'message', message: 'message text' };\n        renderComponent(props);\n        expect(screen.getByText('message text')).toBeInTheDocument();\n        expect(screen.getByRole('alert')).toHaveClass('MuiAlert-standardMessage');\n    });\n\n    it('does not render anything when message is null', () => {\n        const props = { severity: 'message' };\n        const { container } = renderComponent(props);\n        expect(container.firstChild).toBeNull();\n    });\n});\n"},"src/hooks/UsePagination.test.js":{"tests":[{"id":"250","name":"UsePagination should initialize","location":{"start":{"column":6,"line":24}}},{"id":"251","name":"UsePagination changing page should change page","location":{"start":{"column":6,"line":32}}},{"id":"252","name":"UsePagination changing rowsPerPage should change rowsPerPage","location":{"start":{"column":6,"line":40}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { act, renderHook, waitFor } from '@testing-library/react';\nimport usePagination from './UsePagination';\n\ndescribe('UsePagination', () => {\n    it('should initialize', async () => {\n        const { result } = renderHook(() => usePagination(10));\n        await waitFor(() => {\n            expect(result.current.page).toEqual(0);\n            expect(result.current.rowsPerPage).toEqual(10);\n        });\n    });\n\n    it('changing page should change page', async () => {\n        const { result } = renderHook(() => usePagination(10));\n        await waitFor(() => {\n            act(() => result.current.setPage(2));\n            expect(result.current.page).toEqual(2);\n        });\n    });\n\n    it('changing rowsPerPage should change rowsPerPage', async () => {\n        const { result } = renderHook(() => usePagination(10));\n        await waitFor(() => {\n            act(() => result.current.setRowsPerPage(20));\n            expect(result.current.rowsPerPage).toEqual(20);\n        });\n    });\n});\n"},"src/services/Data.test.js":{"tests":[{"id":"253","name":"Data should construct","location":{"start":{"column":6,"line":24}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport { fromIPv4 } from '@utils';\nimport Data from './Data';\n\ndescribe('Data', () => {\n    it('should construct', () => {\n        const data = new Data(\n            111,\n            '2011-06',\n            '192.168.1.14',\n            '00:24:8D:28:F2:9A',\n            'COMPUTER-1',\n            202809,\n            11512,\n            1307160300,\n            1308013207\n        );\n        expect(data.id).toEqual(111);\n        expect(data.IP).toEqual(fromIPv4('192.168.1.14'));\n        expect(data.MAC).toEqual('00:24:8D:28:F2:9A');\n        expect(data.user).toEqual('COMPUTER-1');\n        expect(data.download).toEqual(202809);\n        expect(data.upload).toEqual(11512);\n        expect(data.firstSeen).toEqual(1307160300);\n        expect(data.lastSeen).toEqual(1308013207);\n        expect(data.year).toEqual(2011);\n        expect(data.month).toEqual(6);\n        expect(data.total).toEqual(214321);\n        expect(data.days).toEqual(10);\n        expect(data.average).toEqual(21432.1);\n    });\n});\n"},"src/components/loading/Loading.test.jsx":{"tests":[{"id":"254","name":"Loading renders loading indicator and message when isLoading is true","location":{"start":{"column":6,"line":36}}},{"id":"255","name":"Loading does not render anything when isLoading is false","location":{"start":{"column":6,"line":43}}}],"source":"/*\n *      Copyright (C) 2010 - 2025 VREM Software Development <"+"VREMSoftwareDevelopment@gmail.com>\n *\n *      Licensed under the Apache License, Version 2.0 (the \"License\");\n *      you may not use this file except in compliance with the License.\n *      You may obtain a copy of the License at\n *\n *           http: //www.apache.org/licenses/LICENSE-2.0\n *\n *      Unless required by applicable law or agreed to in writing, software\n *      distributed under the License is distributed on an \"AS IS\" BASIS,\n *      WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *      See the License for the specific language governing permissions and\n *      limitations under the License.\n *\n * Bandwidth Monitor\n */\n\nimport React from 'react';\nimport { render, screen } from '@testing-library/react';\nimport '@testing-library/jest-dom';\nimport { ThemeProvider, createTheme } from '@mui/material/styles';\nimport Loading from './Loading';\n\ndescribe('Loading', () => {\n    const theme = createTheme();\n\n    const renderComponent = (props) =>\n        render(\n            <"+"ThemeProvider theme={theme}>\n                <"+"Loading {...props} />\n            <"+"/ThemeProvider>\n        );\n\n    it('renders loading indicator and message when isLoading is true', () => {\n        const props = { isLoading: true };\n        renderComponent(props);\n        expect(screen.getByRole('progressbar')).toBeInTheDocument();\n        expect(screen.getByText('Loading...')).toBeInTheDocument();\n    });\n\n    it('does not render anything when i
